INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(22, 1, 1, '<p class=\"lead\">Meksyk zachwyca kolorową kulturą i wyjątkowym w skali światowej dorobkiem cywilizacyjnym. Oficjalna nazwa państwa to Meksykańskie Stany Zjednoczone. Meksyk jest 14. największym państwem na świata, a 11 pod względem największej liczby ludności. <br /><br /> Tradycja oraz etniczność przeplata się tutaj z ciągle rozwijającymi się miastami, które tętnią życiem nocnym i mają wiele do zaoferowania. Podróż do Meksyku to nie tylko wypoczynek, ale także wspaniała okazja do poznania kultury skrajnie odmiennej od polskiej. Dzięki temu taka wycieczka może okazać się wyjątkową przygodą, którą pamiętać będziemy przez lata.</p>', '<p>Wakacje w Meksyku</p>', 'wakacje-w-meksyku', '', '', '', 'Mexico Vacation', '', '', '', ''),
(22, 1, 2, '<p class=\"lead\">Meksyk zachwyca kolorową kulturą i wyjątkowym w skali światowej dorobkiem cywilizacyjnym. Oficjalna nazwa państwa to Meksykańskie Stany Zjednoczone. Meksyk jest 14. największym państwem na świata, a 11 pod względem największej liczby ludności. <br /><br /> Tradycja oraz etniczność przeplata się tutaj z ciągle rozwijającymi się miastami, które tętnią życiem nocnym i mają wiele do zaoferowania. Podróż do Meksyku to nie tylko wypoczynek, ale także wspaniała okazja do poznania kultury skrajnie odmiennej od polskiej. Dzięki temu taka wycieczka może okazać się wyjątkową przygodą, którą pamiętać będziemy przez lata.</p>', '<p>Wakacje w Meksyku</p>', 'wakacje-w-meksyku', '', '', '', 'Wakacje w Meksyku', '', '', '', ''),
(23, 1, 1, '<p>Fantastyczny wakacyjny resort z mnóstwem atrakcji. Położony na rozległym terenie wzdłuż zjawiskowej, białej plaży, tuż przy La Estrella, turystycznym \"pueblo\". Architektura hotelu i jego wystrój inspirowane są kolonialnymi motywami, nawiązującymi do miasta Remedios, założonego przez Hiszpanów w XV w. i pierwszej stolicy - Santiago de Cuba. Do budowy użyto tradycyjnych materiałów, a czerwone dachy, witraże, elementy drewniane tworzą niepowtarzalną całość, harmonizującą z bajkowym otoczeniem. Dla wygody turystów po terenie hotelu kursują meleksy. Do dyspozycji Gości są przestronne suite, urządzone w tradycyjnym, kolonialnym stylu. Hotel składa się z trzech części: Paraiso Beach, Grand Memories oraz Sanctuary, dedykowanej tylko pełnoletnim Gościom. Duże baseny, także dla dzieciaków, atrakcje sportowe, animacje dla dorosłych i dla dzieci, duży wybór restauracji tematycznych i barów, sprawiają, że można tu w pełni wykorzystać każdą minutę karaibskich wakacji.</p>', '<p>Cuba Vacation</p>', 'wakacje-na-kubie', '', '', '', 'Cuba Vacation', '', '', '', ''),
(23, 1, 2, '<p>Fantastyczny wakacyjny resort z mnóstwem atrakcji. Położony na rozległym terenie wzdłuż zjawiskowej, białej plaży, tuż przy La Estrella, turystycznym \"pueblo\". Architektura hotelu i jego wystrój inspirowane są kolonialnymi motywami, nawiązującymi do miasta Remedios, założonego przez Hiszpanów w XV w. i pierwszej stolicy - Santiago de Cuba. Do budowy użyto tradycyjnych materiałów, a czerwone dachy, witraże, elementy drewniane tworzą niepowtarzalną całość, harmonizującą z bajkowym otoczeniem. Dla wygody turystów po terenie hotelu kursują meleksy. Do dyspozycji Gości są przestronne suite, urządzone w tradycyjnym, kolonialnym stylu. Hotel składa się z trzech części: Paraiso Beach, Grand Memories oraz Sanctuary, dedykowanej tylko pełnoletnim Gościom. Duże baseny, także dla dzieciaków, atrakcje sportowe, animacje dla dorosłych i dla dzieci, duży wybór restauracji tematycznych i barów, sprawiają, że można tu w pełni wykorzystać każdą minutę karaibskich wakacji.</p>', '<p>Wakacje na Kubie</p>', 'wakacje-w-meksyku', '', '', '', 'Wakacje na Kubie', '', '', '', ''),
(24, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(24, 1, 2, 'Hotel charakteryzuje się świetnym położeniem, przy samym brzegu Morza Czerwonego. Ten luksusowy obiekt doskonale nadaje się na wymarzone rodzinne wakacje w wyjątkowo komfortowych warunkach.', '', 'wakacje-w-albatros-palace-resort', '', '', '', 'Wakacje w Albatros Palace Resort', '', '', '', ''),
(25, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(25, 1, 2, 'Znakomity wybór dla osób ceniących spokojny wypoczynek w luksusowym resorcie. Komfortowe pokoje, bogate All Inclusive 24 godz. oraz szeroki wybór atrakcji zapewnią cudowne wakacje!', '', 'wakacje-w-albatros-palace-sharm-ex-pickalbatros-cyrene-grand', '', '', '', 'Wakacje w Albatros Palace Sharm (ex. Pickalbatros Cyrene Grand)', '', '', '', ''),
(26, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(26, 1, 2, 'Nowoczesny hotel, położony tuż przy plaży z bogatą ofertą all Inclusive. Świetny wybór dla rodzin z dziećmi z uwagi na liczne zjeżdżalnie i dla osób nastawionych na aktywny wypoczynek.', '', 'wakacje-w-albatros-sea-world', '', '', '', 'Wakacje w Albatros Sea World', '', '', '', ''),
(27, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(27, 1, 2, 'Hotel polecamy głównie rodzinom z dziećmi, ze względu na jego bajkową architekturę oraz liczne atrakcje na terenie hotelu i bogatą ofertę rekreacyjną.', '', 'wakacje-w-alf-leila-wa-leila', '', '', '', 'Wakacje w Alf Leila Wa Leila', '', '', '', ''),
(28, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(28, 1, 2, 'Dobrej klasy hotel, polecany osobom aktywnym i lubiącym rozrywkę oraz rodzinom z dziećmi. Dodatkowym atutem jest jeden z największych kompleksów basenowych!', '', 'wakacje-w-ali-baba-palace', '', '', '', 'Wakacje w Ali Baba Palace', '', '', '', ''),
(29, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(29, 1, 2, 'Komfortowy hotel z fantastyczną, wakacyjną atmosferą oraz świetną obsługą. Dobra propozycja dla par oraz miłośników nurkowania. Polecamy!', '', 'wakacje-w-aloha-resort', '', '', '', 'Wakacje w Aloha Resort', '', '', '', ''),
(30, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(30, 1, 2, 'Duży kompleks hotelowy o przyjemnej, wakacyjnej atmosferze, zlokalizowany przy jednej z najpiękniejszych plaż w Kenii. Hotel polecamy zarówno Gościom szukających ciszy i relaksu jak i rodzinom z dziećmi ze względu na duży teren, przyjazną atmosferę i bogate animacje.', '', 'wakacje-w-amani-tiwi-beach-resort', '', '', '', 'Wakacje w Amani Tiwi Beach Resort', '', '', '', ''),
(31, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(31, 1, 2, 'Wygoda, elegancja, czystość, wyjątkowa obsługa, rozrywka i jakość jedzenia to największe atuty hotelu. Piaszczysta plaża, rozległa strefa basenowa ze zjeżdżalniami i bogate zaplecze rekreacyjne dostarczą wielu niezapomnianych wrażeń zarówno dla rodzin z dziećmi jak i osób marzących o wypoczynku i relaksie! Nowocześnie zaprojektowane, przestronne pokoje zapewniają Gościom nowe doświadczenie luksusu i komfortu. Polecamy!', '', 'wakacje-w-amarina-abu-soma-resort--aqua-park', '', '', '', 'Wakacje w Amarina Abu Soma Resort & Aqua Park', '', '', '', ''),
(32, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(32, 1, 2, 'Znakomity wybór dla osób dysponujących skromniejszym budżetem, ceniących sobie korzystny stosunek ceny do jakości.', '', 'wakacje-w-anezi-tower', '', '', '', 'Wakacje w Anezi Tower', '', '', '', ''),
(33, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(33, 1, 2, 'Znakomity hotel ze świetnym serwisem i wygodną formułą All inclusive! Mnóstwo atrakcji, w tym aż ponad 32 zjeżdżalnie! Idealny dla rodzin z dziećmi i aktywnych osób!', '', 'wakacje-w-aqua-blu-resort', '', '', '', 'Wakacje w Aqua Blu Resort', '', '', '', ''),
(34, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(34, 1, 2, 'Dobrej klasy, odnowiony hotel należący do sieci Pickalbatros - bardzo lubianej przez gości ze względu na wysoką jakość usług i bogatą formułę All Inclusive. Rozległy kompleks hotelowy z licznymi atrakcjami i wygodnymi pokojami zapewni wyśmienity wypoczynek wszystkim gościom. Polecany dla rodzin z dziećmi!', '', 'wakacje-w-aqua-vista-resort', '', '', '', 'Wakacje w Aqua Vista Resort', '', '', '', ''),
(35, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(35, 1, 2, 'Szczególnie polecany osobom poszukującym spokojnego wypoczynku w hotelu o dobrym serwisie oraz amatorom sportów wodnych! Malownicza zatoczka umożliwia naukę windsurfingu oraz nurkowania.', '', 'wakacje-w-aurora-bay-resort-exoriental-bay-resort', '', '', '', 'Wakacje w Aurora Bay Resort (ex.Oriental Bay Resort)', '', '', '', ''),
(36, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(36, 1, 2, 'Hotel o przyjaznej, wakacyjnej atmosferze, z bogatą formułą All Inclusive oraz urozmaiconą kuchnią. Szczególnie polecamy osobom chcącym na własną rękę zwiedzać Mombasę, ze względu na bliskość centrum handlowego, restauracji i dyskotek. Idealna propozycja dla Gości dysponujących niewysokim budżetem.', '', 'wakacje-w-bamburi-beach', '', '', '', 'Wakacje w Bamburi Beach', '', '', '', ''),
(37, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(37, 1, 2, 'Wyjątkowy hotel dla najbardziej wymagających. Niezwykle klimatyczne i przestronne wille, niepowtarzalna atmosfera oraz nieziemsko spotykana kuchnia sprawią, że świat stanie w miejscu a Goście będą zachwyceni.', '', 'wakacje-w-baraza-resort--spa-zanzibar', '', '', '', 'Wakacje w Baraza Resort & Spa Zanzibar', '', '', '', ''),
(38, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(38, 1, 2, 'Nowoczesny i bardzo stylowy hotel, otoczony z dwóch stron morzem, tuż przy pięknej plaży, jest idealnym miejscem na wakacyjny relaks i wypoczynek w komfortowych warunkach. Bogata oferta animacyjna, jak również sportowo-rekreacyjna sprawi, że miłośnicy aktywnego wypoczynku również będą zadowoleni z wyboru tego wyjątkowego 5-gwiazdkowego hotelu - polecamy!', '', 'wakacje-w-barcelo-tiran-sharm-resort', '', '', '', 'Wakacje w Barcelo Tiran Sharm Resort', '', '', '', ''),
(39, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(39, 1, 2, 'Luksusowy hotel z oryginalną architekturą, położony tuż przy rajskiej plaży. Wysokiej jakości serwis, wyśmienita kuchnia, a także bogaty wybór sportów to główne atuty tego hotelu. Polecamy Gościom ceniącym sobie aktywny wypoczynek w atrakcyjnym otoczeniu!', '', 'wakacje-w-bluebay-resort-zanzibar', '', '', '', 'Wakacje w Bluebay Resort Zanzibar', '', '', '', ''),
(40, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(40, 1, 2, 'Przyjemny hotel z ciekawą afrykańską architekturą położony tuż przy rajskiej plaży. Doskonała kuchnia i przepiękne położenie to niewątpliwie największe atuty tego hotelu. Polecamy szczególnie Gościom ceniącym sobie wypoczynek oraz kontakt z przepiękną naturą!', '', 'wakacje-w-breezes-beach-club-zanzibar', '', '', '', 'Wakacje w Breezes Beach Club Zanzibar', '', '', '', ''),
(41, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(41, 1, 2, 'Wyjątkowy, luksusowy hotel, położony w otoczeniu egzotycznego ogrodu i bezpośrednio przy piaszczystej plaży jest wymarzonym miejscem na rajskie wakacje we dwoje. Hotel ceniony jest szczególnie za doskonałą kuchnię oraz bogatą ofertę salonu SPA, czyniąc wakacje niezwykłym doświadczeniem, pozwalającym na zapomnienie o codzienności i w pełni oddanie się relaksowi.', '', 'wakacje-w-carana-beach-hotel', '', '', '', 'Wakacje w Carana Beach Hotel', '', '', '', ''),
(42, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(42, 1, 2, 'Komfortowy hotel zapewniający swoim gościom wiele atrakcji, rewelacyjną plażę z centrum sportów wodnych oraz bogate All Inclusive - znakomity wybór dla rodzin z dziećmi oraz miłośników sportów wodnych!', '', 'wakacje-w-caribbean-world-resort', '', '', '', 'Wakacje w Caribbean World Resort', '', '', '', ''),
(43, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(43, 1, 2, 'Przestronne pokoje, mnóstwo atrakcji, rewelacyjny Aquapark oraz bogata formuła All Inclusive z napojami dostępnymi 24 godz.! Gorąco polecamy, szczególnie na rodzinny wypoczynek!', '', 'wakacje-w-charmillion-aqua-park-ex-sea-club-aquapark', '', '', '', 'Wakacje w Charmillion Aqua Park (ex. Sea Club Aquapark)', '', '', '', ''),
(44, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(44, 1, 2, 'Jeden z najbardziej rodzinnych resortów w Marsa Alam - bogaty program All Inclusive oraz ogrom sportów pozwoli na aktywny i atrakcyjny wypoczynek niezależnie od wieku! Ogromny plus za fantastyczny aquapark.', '', 'wakacje-w-club-calimera-akassia-swiss-resort', '', '', '', 'Wakacje w Club Calimera Akassia Swiss Resort', '', '', '', ''),
(45, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(45, 1, 2, 'Polecany dla mało wymagających klientów, szukających spokojnego wypoczynku na pięknej piaszczystej plaży, która jest niewątpliwym atutem hotelu Coral Beach Resort. Polecany zarówno parom jak i rodzinom z dziećmi.', '', 'wakacje-w-coral-beach-resort-hurghada', '', '', '', 'Wakacje w Coral Beach Resort Hurghada', '', '', '', ''),
(46, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(46, 1, 2, 'Niewątpliwymi atutami hotelu są ciekawe położenie w tropikalnym, zielonym ogrodzie, bliskość do pięknej, piaszczystej plaży oraz urozmaicona kuchnia, natomiast szeroki wybór typów pokoi pozwala dopasować ofertę do potrzeb każdego z Gości. Jest idealnym miejscem na romantyczny wyjazd we dwoje lub z grupą znajomych!', '', 'wakacje-w-coral-strand-smart', '', '', '', 'Wakacje w Coral Strand Smart', '', '', '', ''),
(47, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(47, 1, 2, 'Jeden z najchętniej wybieranych hoteli średniej klasy na Seszelach – bliskość pięknej plaży i Oceanu Indyjskiego, urozmaicona kuchnia oraz beztroski wypoczynek na plaży to idealna propozycja dla osób, które chcą odpocząć w ciszy i z dala od miejskiego zgiełku.', '', 'wakacje-w-crown-beach-seychelles', '', '', '', 'Wakacje w Crown Beach Seychelles', '', '', '', ''),
(48, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(48, 1, 2, 'Przyjemny hotel czterogwiazdkowy zlokalizowany przy przepięknej piaszczystej plaży w spokojnej okolicy z udogodnieniami miasta Midoun w zasięgu spaceru. Idealny obiekt dla ludzi lubiących typowe wioski wakacyjne z wieloma atrakcjami za przyzwoitą cenę.', '', 'wakacje-w-dar-djerba-narjess', '', '', '', 'Wakacje w Dar Djerba Narjess', '', '', '', ''),
(49, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(49, 1, 2, 'Dobrej klasy, zadbany hotel z ładnymi pokojami, świetnym wyżywieniem, ciekawymi animacjami oraz przyjemną strefą basenowo - rekreacyjną otoczoną rozległym ogrodem palmowym to opcja idealna dla leniuchów i aktywnych, rodzin i par.', '', 'wakacje-w-djerba-resort-ex-vincci-djerba-resort', '', '', '', 'Wakacje w Djerba Resort (ex. Vincci Djerba Resort)', '', '', '', ''),
(50, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(50, 1, 2, 'Luksusowy, butikowy hotel, który zadowoli najbardziej wymagających Klientów. Wyjątkowa sceneria, serwis, niepowtarzalna lokalna kuchnia oraz przepiękna plaża sprawi, że poczujemy się tutaj jak w raju. Polecamy głównie parom, nowożeńcom oraz grupie znajomych ze względu na niepowtarzalny klimat hotelu.', '', 'wakacje-w-dream-of-africa', '', '', '', 'Wakacje w Dream of Africa', '', '', '', ''),
(51, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(51, 1, 2, 'Bliskość rafy koralowej oraz bogata oferta sportów i animacji dostępnych w hotelu w bardzo przystępnej cenie! Szczególnie polecany miłośnikom sportów!', '', 'wakacje-w-elphistone-resort', '', '', '', 'Wakacje w Elphistone Resort', '', '', '', ''),
(52, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(52, 1, 2, 'Przyjemna wioska wakacyjna położona w rozległym ogrodzie palmowych składająca się z kilkunastu mniejszych budynków utrzymanych w tunezyjskim stylu. Hotel oferuje zróżnicowaną ofertę animacyjną, kilka basenów oraz Aquapark', '', 'wakacje-w-fiesta-beach', '', '', '', 'Wakacje w Fiesta Beach', '', '', '', ''),
(53, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(53, 1, 2, 'Hotel dla osób ceniących spokój, kochających morze i podglądanie podwodnego życia na bajecznych rafach koralowych Morza Czerwonego. Położony jest nad brzegiem morza (część Beach) oraz w przepięknym ogrodzie (część Resort). Polecany na sielski wypoczynek zarówno dla par jak i rodzin z dziećmi.', '', 'wakacje-w-flamenco-beach--resort', '', '', '', 'Wakacje w Flamenco Beach & Resort', '', '', '', ''),
(54, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(54, 1, 2, 'W hotelu można spędzić wakacje marzeń – odpocząć, aktywnie spędzić czas a nawet nagrać film. Hotel szczególnie polecamy dla rodzin z dziećmi i osobom nastawionym na aktywny wypoczynek.', '', 'wakacje-w-golden-beach-resort-ex-movie-gate-resort', '', '', '', 'Wakacje w Golden Beach Resort (ex Movie Gate Resort)', '', '', '', ''),
(55, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(55, 1, 2, 'Nowo otwarty hotel zachwyca oryginalną architekturą i malowniczą lokalizacją przy pięknym odcinku wybrzeża Morza Czerwonego. Spokojne sąsiedztwo hotelu zapewni błogi relaks i beztroski wypoczynek z dala od miasta, czy to na plaży, czy przy jednym z wielu basenów. Dla pragnących rozrywki hotel oferuje szereg atrakcji. Polecamy!', '', 'wakacje-w-gravity-sahl-haseesh-ex-ocean-breeze', '', '', '', 'Wakacje w Gravity Sahl Haseesh (ex Ocean Breeze)', '', '', '', ''),
(56, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(56, 1, 2, 'Doskonała lokalizacja przy pięknej plaży Nyali, z białym piaskiem, za niewygórowaną cenę! W okolicy hotelu liczne bary, restauracje i dyskoteki. Polecamy osobom pragnącym odkrywać okolicę we własnym zakresie ze względu na bliskość farmy krokodyli i Parku Hallera. Miła, uczynna obsługa, dobra i urozmaicona kuchnia.', '', 'wakacje-w-hotel-reef', '', '', '', 'Wakacje w Hotel Reef', '', '', '', ''),
(57, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(57, 1, 2, 'Elegancki i komfortowy, gustownie urządzony obiekt, który został niedawno remontowany. Piękna plaża, dobry serwis hotelowy oraz znakomite wyżywienie sprawią, że pobyt na pewno zaliczy się do udanych. Szczególnie polecamy parom, a ze względu na animacje także rodzinom z dziećmi.', '', 'wakacje-w-iberostar-diar-el-andalous', '', '', '', 'Wakacje w IBEROSTAR Diar El Andalous', '', '', '', ''),
(58, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(58, 1, 2, 'Jeden z najlepszych hoteli w Agadirze, który bije rekordy popularności od lat! Na przełomie 2017/2018 wszystkie pokoje oraz część infrastruktury zostały gruntownie odremontowane. Obiekt jest świetnie zlokalizowany, w spokojnej okolicy tuż przy plaży i spełni oczekiwania najbardziej wymagających Klientów.', '', 'wakacje-w-iberostar-founty-beach', '', '', '', 'Wakacje w IBEROSTAR Founty Beach', '', '', '', ''),
(59, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(59, 1, 2, 'Dobry i znany na rynku hotel rodzinny należący do międzynarodowej sieci Iberostar. Obiekt urzeka rozległym i zadbanym ogrodem oraz przepiękną piaszczystą plażą. Dodatkowymi plusami są eleganckie pokoje i mnogość animacji. Polecamy hotel dla Klientów wymagających, lubiących aktywne wakacje oraz dla rodzin z dziećmi.', '', 'wakacje-w-iberostar-mehari-djerba', '', '', '', 'Wakacje w IBEROSTAR Mehari Djerba', '', '', '', ''),
(60, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(60, 1, 2, 'Elegancki hotel o rozbudowanej infrastrukturze dla wymagających Klientów. Szeroki zakres animacji, niedaleka odległość do centrum miasta, bogate all inclusive i piaszczysta plaża urozmaicą pobyt. Hotel dedykowany Klientom w każdym wieku.', '', 'wakacje-w-iberostar-royal-el-mansour', '', '', '', 'Wakacje w IBEROSTAR Royal El Mansour', '', '', '', ''),
(61, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(61, 1, 2, 'Nowy, ekskluzywny i elegancki obiekt zadowoli najbardziej wymagających Klientów. Piękna piaszczysta plaża, ciekawe animacje, dobre jedzenie i przestronne pokoje – to obowiązkowe składniki udanych wakacji.', '', 'wakacje-w-iberostar-selection-kuriat-palace', '', '', '', 'Wakacje w IBEROSTAR Selection Kuriat Palace', '', '', '', ''),
(62, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(62, 1, 2, 'Stylowy hotel położony tuż przy słynącej ze swojego piękna plaży Diani. Zaletą hotelu są klimatycznie urządzone pokoje oraz dobre jedzenie. Hotel polecamy głównie osobom pragnącym wypoczywać w atmosferze relaksu i spokoju, ciesząc się pięknymi widokami.', '', 'wakacje-w-jacaranda-indian-ocean-beach-resort', '', '', '', 'Wakacje w Jacaranda Indian Ocean Beach Resort', '', '', '', ''),
(63, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(63, 1, 2, 'Duży, nowoczesny i luksusowy hotel z rewelacyjną lokalizacją przy samej plaży! Ceniony wśród Gości za bogactwo animacji, dobry serwis i dobrą kuchnię. Dedykowany osobom preferującym aktywny wypoczynek, a także rodzinom z dziećmi.', '', 'wakacje-w-jaz-aquamarine', '', '', '', 'Wakacje w Jaz Aquamarine', '', '', '', ''),
(64, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(64, 1, 2, 'Bardzo fajna wycieczka', '', 'wakacje-w-jaz-belvedere', '', '', '', 'Wakacje w Jaz Belvedere', '', '', '', ''),
(65, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(65, 1, 2, 'Hotel przyciągający gości ciekawą architekturą oraz znakomitym serwisem i kuchnią! Szczególnie polecany rodzinom z dziećmi, a także osobom ceniącym wypoczynek w luksusowym hotelu.', '', 'wakacje-w-jaz-grand-marsa-ex-jaz-grand-resta', '', '', '', 'Wakacje w Jaz Grand Marsa (ex. Jaz Grand Resta)', '', '', '', ''),
(66, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(66, 1, 2, 'Elegancki i przestronny hotel zapewniający wiele rozrywki z pewnością zadowoli nawet najbardziej wymagające rodziny.', '', 'wakacje-w-jaz-lamaya', '', '', '', 'Wakacje w Jaz Lamaya', '', '', '', ''),
(67, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(67, 1, 2, 'Posiada niezwykle szeroką ofertę rekreacyjną, zarówno dla tych bardziej oraz mniej aktywnych. Idealny dla rodzinnego wypoczynku ze względu na wspaniały - największy w Hurghadzie park wodny!', '', 'wakacje-w-jungle-aqua-park', '', '', '', 'Wakacje w Jungle Aqua Park', '', '', '', ''),
(68, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(68, 1, 2, 'Dobrej klasy hotel o doskonałym położeniu przy szerokiej piaszczystej plaży, oferujący zakwaterowanie w komfortowych domkach, w otoczeniu tropikalnego ogrodu. Wyśmienita kuchnia, doskonały serwis oraz szeroka oferta hotelowego SPA pozwoli na błogi odpoczynek. Polecamy na romantyczne wakacje we dwoje!', '', 'wakacje-w-karafuu-beach-resort--spa', '', '', '', 'Wakacje w Karafuu Beach Resort & Spa', '', '', '', ''),
(69, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(69, 1, 2, 'Rodzinny hotel położony w urokliwym ogrodzie, tuż przy pięknej piaszczystej plaży Diani. Polecamy zarówno parom jak i rodzinom z dziećmi ze względu na bogaty program animacyjny. Idealny hotel na aktywne wakacje w tropikalnym otoczeniu.', '', 'wakacje-w-kaskazi-beach', '', '', '', 'Wakacje w Kaskazi Beach', '', '', '', ''),
(70, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(70, 1, 2, 'Ekskluzywny hotel charakteryzujący się wysokim standardem świadczonych usług, dbałością o detale, a także lokalizacją przy przepięknej plaży. Komfortowe wnętrza, doskonała kuchnia, a także szeroki wybór atrakcji w hotelu spełnią wymagania nawet najbardziej wymagających Gości. Szczególnie polecamy na wakacje we dwoje lub w gronie rodziny.', '', 'wakacje-w-kempinski-seychelles-resort', '', '', '', 'Wakacje w Kempinski Seychelles Resort', '', '', '', ''),
(71, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(71, 1, 2, 'Hotel o swobodnej, wakacyjnej atmosferze, ceniony wśród Gości za smaczną kuchnię. Dodatkowym plusem jest przyjazna obsługa, dbająca o spokojny wypoczynek. Szczególnie polecamy osobom chcącym odkrywać Mombasę na własną rękę, ze względu na bliskość centrum handlowego, restauracji i dyskotek. Idealna propozycja dla Gości chcących wypocząć za niewygórowaną cenę!', '', 'wakacje-w-kenya-bay', '', '', '', 'Wakacje w Kenya Bay', '', '', '', ''),
(72, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(72, 1, 2, 'Dobrej klasy hotel zlokalizowany tuż przy centrum miasta z szerokim wyborem rozrywek na terenie samego obiektu, jak i w najbliższej okolicy. Nieduży, ale bardzo dobrze zagospodarowany teren hotelowy, przemiła obsługa oraz znakomite jedzenie to największe atuty hotelu.', '', 'wakacje-w-kenzi-europa', '', '', '', 'Wakacje w Kenzi Europa', '', '', '', ''),
(73, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(73, 1, 2, 'Kameralny hotel o ciekawej architekturze i przyjemnych wnętrzach. Malowniczo położony w egzotycznym ogrodzie tuż przy szerokiej plaży z białym piaskiem to idealne miejsce na rajskie wakacje. Dodatkowo – bardzo dobry serwis i chwalona wśród Gości kuchnia!', '', 'wakacje-w-kilifi-bay-beach-resort', '', '', '', 'Wakacje w Kilifi Bay Beach Resort', '', '', '', ''),
(74, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(74, 1, 2, 'Doskonała lokalizacja bezpośrednio przy plaży i blisko centrum Agadiru, szeroki wybór rozrywek na miejscu.', '', 'wakacje-w-lti-agadir-beach-club', '', '', '', 'Wakacje w LTI Agadir Beach Club', '', '', '', ''),
(75, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(75, 1, 2, 'Dobry hotel zapewniający wszystkie niezbędne elementy składające się na udane wakacje. Największy plus za piękną piaszczystą plażę, ciekawe animacje oraz znakomity serwis all inclusive.', '', 'wakacje-w-lti-bellevue-park', '', '', '', 'Wakacje w LTI Bellevue Park', '', '', '', ''),
(76, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(76, 1, 2, 'Zadbany hotel niedaleko urokliwego historycznego centrum Mahdii. Doskonałe warunki plażowe i bogaty program animacyjny zapewniają urozmaicony wypoczynek zarówno osobom aktywnym, jak i rodzinom z dziećmi. Ogromnym atutem hotelu jest rewelacyjny aquapark z kilkoma zjeżdżalniami dla dorosłych i dzieci, który zapewni znakomitą rozrywkę w trakcie pobytu.', '', 'wakacje-w-lti-mahdia-beach', '', '', '', 'Wakacje w LTI Mahdia Beach', '', '', '', ''),
(77, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(77, 1, 2, 'Świetna lokalizacja bezpośrednio przy malowniczej plaży, zapierające dech w piersiach zachody słońca i dostęp do bogatych raf koralowych sprawią, że będą to niezapomniane wakacje! Dodatkowym atutem jest Promenada Makadi z możliwością wyboru spośród restauracji serwujących dania z całego świata.', '', 'wakacje-w-labranda-club-makadi', '', '', '', 'Wakacje w Labranda Club Makadi', '', '', '', ''),
(78, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(78, 1, 2, 'Świetny hotel atrakcyjnie położony w Zatoce Makadi tuż przy plaży, polecany szczególnie dla rodzin z dziećmi ze względu na liczne animacje oraz organizowane zabawy. Bogata oferta all inclusive, ogromny wybór restauracji i barów, luksus, profesjonalna obsługa - z pewnością zachwyci wszystkich szukających wakacyjnego relaksu gości. Serdecznie polecamy!', '', 'wakacje-w-labranda-royal-makadi', '', '', '', 'Wakacje w Labranda Royal Makadi', '', '', '', ''),
(79, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(79, 1, 2, 'Egzotyczny, położony wzdłuż pięknej plaży hotel, jest wymarzonym miejscem na romantyczne wakacje we dwoje. Polecamy ze względu na szeroką ofertę sportową oraz świetną cenę, przygotowaną wyłącznie dla Klientów Rainbow.', '', 'wakacje-w-le-meridien-ile-maurice', '', '', '', 'Wakacje w Le Meridien Ile Maurice', '', '', '', ''),
(80, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(80, 1, 2, 'W Lemon Soul Makadi Bay zapach owoców cytrusowych przenika lobby, a dzieła sztuki rozlokowane na terenie hotelu inspirowane cytryną wywołują uśmiechy na twarzach gości. To idealne miejsce na wypełnione zabawą wakacje! Hotel tylko dla dorosłych.', '', 'wakacje-w-lemon--soul-makadi', '', '', '', 'Wakacje w Lemon & Soul Makadi', '', '', '', ''),
(81, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(81, 1, 2, 'Świetny kompleks, w którym komfortowo i bezpiecznie można spędzić relaksujące wakacje. Szczególnie dedykowany rodzinom z dziećmi ze względu na duży, bezpieczny teren, łagodne zejście do morza oraz rozległe baseny. Ciekawy program animacyjny pozwoli na atrakcyjne dopełnienie beztroskiego urlopu. Serdecznie polecamy!', '', 'wakacje-w-magic-tulip-beach-resort', '', '', '', 'Wakacje w Magic Tulip Beach Resort', '', '', '', ''),
(82, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(82, 1, 2, 'Dobrze utrzymany hotel 5-gwiazdkowy, który oferuje wysoki standard zakwaterowania. Idealne miejsce dla osób poszukujących odrobiny luksusu, przy najpiękniejszej plaży w Tunezji.', '', 'wakacje-w-mahdia-palace', '', '', '', 'Wakacje w Mahdia Palace', '', '', '', ''),
(83, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(83, 1, 2, 'Ten 5-gwiazdkowy hotel, to istny raj na ziemi. Idealny na ekskluzywne wakacje dla wymagających Klientów.', '', 'wakacje-w-maritim-resort--spa', '', '', '', 'Wakacje w Maritim Resort & SPA', '', '', '', ''),
(84, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(84, 1, 2, '\"Wakacje w Melia Llana Resort &amp; Spa\"', '', 'wakacje-w-melia-llana-resort--spa', '', '', '', '\"Wakacje w Melia Llana Resort & Spa\"', '', '', '', ''),
(85, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(85, 1, 2, 'Podstawowy i skromny, aczkolwiem klimatyczny hotel trzygwiazdkowy skierowany dla osób dysponujących skromniejszym budżetem. Polecamy głównie parom.', '', 'wakacje-w-miramar-petit-palais', '', '', '', 'Wakacje w Miramar Petit Palais', '', '', '', ''),
(86, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(86, 1, 2, 'Luksusowy hotel, świetnie zlokalizowany przy plaży i w niedużej odległości od centrum Sousse. Polecamy najbardziej wymagającym gościom.', '', 'wakacje-w-moevenpick-resort--spa', '', '', '', 'Wakacje w Moevenpick Resort & Spa', '', '', '', ''),
(87, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(87, 1, 2, 'Niewielki hotel o przyjemnej, wakacyjnej atmosferze. Hotel lubiany jest za przestronne pokoje oraz miłą obsługę. Dodatkowym atutem jest nieduża odległość od lotniska oraz krótki czas transferu. Hotel dla szerokiej gamy odbiorców: zarówno dla par, osób młodych – ze względu na bliskość rozrywek oraz dla osób ceniących aktywny wypoczynek.', '', 'wakacje-w-neptune-beach-resort', '', '', '', 'Wakacje w Neptune Beach Resort', '', '', '', ''),
(88, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(88, 1, 2, 'Jeden z najlepszych hoteli w Kenii o bardzo wysokim standardzie świadczonych usług, dobrym serwisie i wyśmienitej kuchni. Piękna plaża i kameralna atmosfera sprawia, że jest to doskonały hotel na romantyczny wyjazd we dwoje oraz dla osób, które szukają ciszy i spokoju. Polecamy również osobom aktywnym ze względu na dostępność centrum sportowego w położonym na wspólnym terenie hotelu Neptune Paradise Beach Resort SPA. Hotel doceniany przez naszych Gości od wielu sezonów.', '', 'wakacje-w-neptune-palm-beach-boutique-resort--spa', '', '', '', 'Wakacje w Neptune Palm Beach Boutique Resort & SPA', '', '', '', ''),
(89, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(89, 1, 2, 'Dobrej klasy hotel, wybudowany w tradycyjnym afrykańskim stylu, położony przy jednej z najpiękniejszych plaż na południowym wybrzeżu - plaży Galu. Polecamy parom oraz osobom szukającym ciszy i spokoju, a także dzięki bogatej infrastrukturze sportowej na terenie hotelu Neptune Village, Gościom nastawionym na aktywny wypoczynek. Dodatkowym atutem hotelu są eleganckie, wyremontowane pokoje.', '', 'wakacje-w-neptune-paradise-beach-resort--spa', '', '', '', 'Wakacje w Neptune Paradise Beach Resort & SPA', '', '', '', ''),
(90, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(90, 1, 2, 'Hotel o przyjaznej, wakacyjnej atmosferze z serwisem na wysokim poziomie! Bogata formuła All Inclusive z wyśmienitą kuchnią, a także szeroki wachlarz sportów i animacji dostępnych w hotelu pozwolą na błogie, wakacyjne lenistwo w rajskim otoczeniu!', '', 'wakacje-w-neptune-pwani-beach-resort--spa', '', '', '', 'Wakacje w Neptune Pwani Beach Resort & Spa', '', '', '', ''),
(91, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(91, 1, 2, 'Przyjemny hotel o wesołej, wakacyjnej atmosferze, wybudowany w tradycyjnym afrykańskim stylu, położony przy jednej z najpiękniejszych plaż na południowym wybrzeżu. Polecamy rodzinom z dziećmi ze względu na bogate animacje oraz osobom nastawionym na aktywny wypoczynek. Hotel bardzo lubiany przez naszych Gości.', '', 'wakacje-w-neptune-village-beach-resort--spa', '', '', '', 'Wakacje w Neptune Village Beach Resort & SPA', '', '', '', ''),
(92, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(92, 1, 2, 'Bardzo dobry hotel, dostępny w wyjątkowo atrakcyjnej cenie. Świetna lokalizacja przy jednej z najładniejszych, piaszczystych plaż Tunezji. Polecamy rodzinom z dziećmi.', '', 'wakacje-w-nour-palace', '', '', '', 'Wakacje w Nour Palace', '', '', '', ''),
(93, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(93, 1, 2, 'Przyjemny hotel z miłą atmosferą dla niewymagających Klientów. Skromne pokoje, dobra lokalizacja względem centrum i lotniska, krótki transfer. Polecamy głównie Gościom nastawionym na odpoczynek w ciągu dnia przy pięknej plaży a także grupom znajomych i osobom młodym ze względu na bogate wieczorne animacje i bliskość rozrywek.', '', 'wakacje-w-nyali-sun-africa', '', '', '', 'Wakacje w Nyali Sun Africa', '', '', '', ''),
(94, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(94, 1, 2, 'Ekskluzywny i kameralny hotel dla bardziej wymagających Gości. Bogata oferta zabiegów SPA i odnowy biologicznej to gwarancja relaksu i wypoczynku w miłej, spokojnej atmosferze. Hotel wyróżnia się wyśmienitą lokalną i międzynarodową kuchnią, a bliskość centrum Malindi daje możliwość na odkrycie tej części Kenii na własną rękę.', '', 'wakacje-w-ocean-beach-resort--spa', '', '', '', 'Wakacje w Ocean Beach Resort & SPA', '', '', '', ''),
(95, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(95, 1, 2, 'Jeden z lepszych hoteli w naszej ofercie z bogatym zapleczem rekreacyjno-sportowym oraz aqua parkiem, który świetnie się sprawdzi jako propozycja dla osób aktywnych oraz rodzin z dziećmi. Nowoczesne i wygodne pokoje, a także bezpośrednie położenie przy plaży to dodatkowe atuty obiektu.', '', 'wakacje-w-palm-azur-ex-sentido-palm-azur', '', '', '', 'Wakacje w Palm Azur (ex. Sentido Palm Azur)', '', '', '', ''),
(96, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(96, 1, 2, 'Przyjemny hotel, którego głównym atutem jest położenie przy pięknej, szerokiej plaży Diani z drobnym, białym piaskiem. Goście szczególnie cenią hotel za bardzo dobrą kuchnię, piękny ogród oraz atmosferę, która sprzyja relaksowi. Polecamy zarówno parom jak i rodzinom z dziećmi ze względu na przestronne pokoje oraz bogate animacje. Bardzo dobra oferta w atrakcyjnej cenie.', '', 'wakacje-w-papillon-lagoon-reef', '', '', '', 'Wakacje w Papillon Lagoon Reef', '', '', '', ''),
(97, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(97, 1, 2, 'Komfortowy hotel, doskonale położony przy samej plaży, znany ze swojej znakomitej kuchni i świetnego serwisu. Polecamy parom, miłośnikom nurkowania oraz aktywnego wypoczynku!', '', 'wakacje-w-parrotel-beach-resort-ex-radisson-blu-resort-sharm', '', '', '', 'Wakacje w Parrotel Beach Resort (ex Radisson Blu Resort Sharm)', '', '', '', ''),
(98, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(98, 1, 2, 'Skromny hotel dla mniej wymagających osób. Jego zaletą jest piękna rafa koralowa bezpośrednio przy hotelu. Dobry wybór dla aktywnych.', '', 'wakacje-w-pensee-royal-garden-beach-resort', '', '', '', 'Wakacje w Pensee Royal Garden Beach Resort', '', '', '', ''),
(99, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(99, 1, 2, 'Hotel o doskonałym położeniu przy przepięknej plaży, lubiany wśród Gości za dobry serwis i typowo wakacyjną atmosferę. Idealny wybór na rodzinne wakacje – bogaty program animacyjny dla dzieci i dorosłych oraz pełen atrakcji aqua park, tak wyjątkowy w tym regionie Kenii, z pewnością nie pozwolą na nudę!', '', 'wakacje-w-prideinn-paradise-beach-resort', '', '', '', 'Wakacje w Prideinn Paradise Beach Resort', '', '', '', ''),
(100, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(100, 1, 2, 'Hotel ceniony za świetne animacje i przyjazną atmosferę. Ze względu na bogaty program sportowo animacyjny szczególnie polecany osobom, które lubią aktywnie odpoczywać.', '', 'wakacje-w-ramada-liberty-resort', '', '', '', 'Wakacje w Ramada Liberty Resort', '', '', '', ''),
(101, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(101, 1, 2, 'Wysokiej klasy hotel urządzony elegancko i ze smakiem położony na zadbanym terenie tuż przy szerokiej, piaszczystej plaży, z łagodnym, piaszczystym zejściem do morza stanowiącej ogromny atut hotelu.', '', 'wakacje-w-riu-tikida-palace', '', '', '', 'Wakacje w Riu Tikida Palace', '', '', '', ''),
(102, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(102, 1, 2, 'Najlepszy wybór dla wymagających oraz dla rodzin z dziećmi - wiele atrakcji sportowych i animacji, zjeżdżalnie oraz centrum sportów wodnych!', '', 'wakacje-w-royal-albatros-moderna', '', '', '', 'Wakacje w Royal Albatros Moderna', '', '', '', ''),
(103, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(103, 1, 2, 'Royal Decameron to wysokiej klasy hotel, który może zachęcić przyjemnymi pokojami, ciekawymi animacjami prowadzonymi przez profesjonalnych animatorów oraz fantastycznym położeniem tuż przy piaszczystej plaży nad samym Oceanem Atlantyckim.', '', 'wakacje-w-royal-decameron-tafoukt', '', '', '', 'Wakacje w Royal Decameron Tafoukt', '', '', '', ''),
(104, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(104, 1, 2, 'Wysokiej klasy obiekt przeznaczony dla najbardziej wymagających Klientów. Piękne i eleganckie pokoje, zadbany zielony ogród oraz liczne rozrywki organizowane przez hotel zapewnią wspaniałe wakacje!', '', 'wakacje-w-royal-garden-palace', '', '', '', 'Wakacje w Royal Garden Palace', '', '', '', ''),
(105, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(105, 1, 2, 'Wyjątkowy, ekskluzywny hotel o niezwykle egzotycznym charakterze, położony przy rajskiej plaży! Wypoczynek na białej plaży, skąpanej w lazurowych wodach oceanu to wymarzona wakacyjna propozycja, a dodatkowo doskonała obsługa, wyśmienita kuchnia oraz luksusowe pokoje oczarują najbardziej wymagających Gości.', '', 'wakacje-w-royal-zanzibar-beach-resort', '', '', '', 'Wakacje w Royal Zanzibar Beach Resort', '', '', '', ''),
(106, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(106, 1, 2, 'Niewątpliwym atutem tego hotelu jest przyjazny personel oraz świetna lokalizacja - bezpośrednio przy plaży oraz w bliskim zasięgu tętniącej życiem Hurghady i wielu punktów usługowych znajdujących się w pobliżu. Ten 4-gwiazdkowy komfortowy hotel przypadnie do gustu wszystkim, którzy lubią aktywny wypoczynek i chcą mieć łatwy dostęp do miejskich atrakcji.', '', 'wakacje-w-samra-bay', '', '', '', 'Wakacje w Samra Bay', '', '', '', ''),
(107, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(107, 1, 2, 'Elegancki, klimatyczny hotel o beztroskiej, wakacyjnej atmosferze i wysokim standardzie świadczonych usług. Ze względu na przestronne pokoje oraz bogatą ofertę animacyjną polecamy zarówno rodzinom z dziećmi, jak również Gościom preferującym aktywny wypoczynek z odrobiną luksusu. Przepiękna plaża Silversand pokryta palmami kokosowymi pozwoli w pełni poczuć klimat egzotycznych wakacji!', '', 'wakacje-w-sandies-tropical-village', '', '', '', 'Wakacje w Sandies Tropical Village', '', '', '', ''),
(108, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(108, 1, 2, 'Elegancki hotel o wysokim standardzie świadczonych usług, bardzo ceniony przez swoich Gości za indywidualne podejście do Klienta i dbałość o każdy szczegół. Jego zdecydowanym atutem są pokoje o dużej powierzchni, zrelaksowana atmosfera, idealna dla wakacyjnego wypoczynku oraz doskonała kuchnia. Polecamy głównie parom oraz rodzinom ze starszymi dziećmi.', '', 'wakacje-w-sarova-whitesands-beach-resort--spa', '', '', '', 'Wakacje w Sarova Whitesands Beach Resort & SPA', '', '', '', ''),
(109, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(109, 1, 2, 'Elegancki hotel należący do cenionej sieci hotelowej, gwarantującej wysoki poziom usług, położony w pięknym, tropikalnym ogrodzie. To idealne miejsce na błogi wypoczynek na białej plaży, kąpiele w lazurowych wodach oceanu, a także romantyczne spacery o zachodzie słońca. Szczególnie polecamy wymagającym Gościom, podróżującym we dwoje lub z rodziną.', '', 'wakacje-w-savoy-resort--spa-seychelles', '', '', '', 'Wakacje w Savoy Resort & Spa Seychelles', '', '', '', ''),
(110, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(110, 1, 2, 'Hotel dobrze znany polskim Gościom, chętnie wybierany ze względu na dobry serwis oraz doskonałą lokalizację w centrum Hurghady! Oferuje bogaty program all inclusive oraz aquapark za rozsądną cenę.', '', 'wakacje-w-sea-gull', '', '', '', 'Wakacje w Sea Gull', '', '', '', ''),
(111, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(111, 1, 2, 'Bardzo dobrej klasy hotel, ceniony ze względu na najwyższej jakości serwis i znakomite jedzenie. Polecany wymagającym Klientom, którzy szukają spokojnego wypoczynku.', '', 'wakacje-w-sea-star-beaurivage', '', '', '', 'Wakacje w Sea Star Beaurivage', '', '', '', ''),
(112, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(112, 1, 2, 'Odświeżony hotel, po całkowitej renowacji - idealny na wakacyjny wypoczynek dla par! Spokojna, śliczna plaża, bez tłoku i z dala od zgiełku wielkich kurortów. Polecamy Klientom pragnącym nieco spokoju i wytchnienia nad ciepłym oceanem. W razie potrzeby można w 15 minut dojechać do słynnego kurortu Grand Baie. Serdecznie zapraszamy!', '', 'wakacje-w-sealife-resort--spa', '', '', '', 'Wakacje w Sealife Resort & Spa', '', '', '', ''),
(113, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(113, 1, 2, 'Luksusowy hotel zapewniający swoim Gościom zarówno relaks, jak i bogaty wybór atrakcji, doskonałe centrum SPA, a także centrum sportów wodnych na plaży nie pozwolą się nudzić. Dodatkowo hotel może poszczycić się wyśmienitą kuchnią, a także ciekawą architekturą i pięknym, egzotycznym ogrodem, tworzącymi atmosferę sprzyjającą relaksowi. Polecany wymagającym Gościom!', '', 'wakacje-w-serena-beach-resort--spa', '', '', '', 'Wakacje w Serena Beach Resort & SPA', '', '', '', ''),
(114, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(114, 1, 2, 'Obiekt kusi bardzo dobrym standardem usług oraz prywatną plażą hotelową z dostępem do rafy koralowej. Polecamy dla par i rodzin z dziećmi !', '', 'wakacje-w-sharm-grand-plaza', '', '', '', 'Wakacje w Sharm Grand Plaza', '', '', '', ''),
(115, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(115, 1, 2, 'Luksusowy hotel z doskonałą lokalizacją przy deptaku Mamsha i bezpośrednio przy plaży, z bogatym programem all inclusive (dostępnym całą dobę!), świetnym kompleksem basenów oraz niezwykle szeroką ofertą sportów i animacji. Polecamy wymagającym Klientom, którzy cenią sobie wypoczynek w ekskluzywnym hotelu z serwisem na najwyższym poziomie!', '', 'wakacje-w-steigenberger-al-dau-beach', '', '', '', 'Wakacje w Steigenberger Al Dau Beach', '', '', '', ''),
(116, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(116, 1, 2, 'Doskonały hotel, ceniony wśród gości za piękne rafy koralowe, pyszne jedzenie i wysoki standard obsługi. Znakomity wybór zarówno dla osób chcących wypocząć, jak i aktywnie spędzić czas.', '', 'wakacje-w-stella-di-mare-beach-resort--spa', '', '', '', 'Wakacje w Stella Di Mare Beach Resort & Spa', '', '', '', ''),
(117, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(117, 1, 2, 'Tętniący życiem hotel zapewni mnóstwo frajdy amatorom wodnych atrakcji. Dzięki swej lokalizacji w słynącej z pięknych raf koralowych Zatoce Makadi, sprawdzi się również idealnie na udane wakacje dla miłośników snurkowania i nurkowania. Serdecznie polecamy!', '', 'wakacje-w-stella-di-mare-gardens-resort--spa', '', '', '', 'Wakacje w Stella Di Mare Gardens Resort & Spa', '', '', '', ''),
(118, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(118, 1, 2, 'Pięciogwiazdkowy hotel z dużą liczbą atrakcji i szerokim zapleczem sportowo-rekreacyjnym. Znakomity wybór dla rodzin z dziećmi oraz idealne miejsce dla osób poszukujących aktywnego wypoczynku.', '', 'wakacje-w-sultan-gardens', '', '', '', 'Wakacje w Sultan Gardens', '', '', '', ''),
(119, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(119, 1, 2, 'Przyjemny hotel z ciekawą afrykańską architekturą i pięknym tropikalnym ogrodem. Zjawiskowa plaża z białym piaskiem oraz doskonała kuchnia to niewątpliwie największe atuty tego hotelu. Polecamy szczególnie Gościom ceniącym sobie aktywny wypoczynek oraz kontakt z przepiękną naturą!', '', 'wakacje-w-sultan-sands-island-resort', '', '', '', 'Wakacje w Sultan Sands Island Resort', '', '', '', ''),
(120, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(120, 1, 2, 'Bardzo dobra opcja na wakacje w gronie przyjaciół - hotel oferuje duży wybór animacji oraz dyskotekę, a na plaży znajduje się centrum sportów wodnych. Budżetowa propozycja dla mniej wymagających Klientów!', '', 'wakacje-w-sunny-days-resort-spa--aqua-park-ex-el-palacio', '', '', '', 'Wakacje w Sunny Days Resort Spa & Aqua Park (ex El Palacio)', '', '', '', ''),
(121, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(121, 1, 2, 'Kameralny hotel łączący afrykański wystrój z europejskim wyczuciem estetyki. Polecamy Gościom nastawionym na połączenie spokojnego odpoczynku oraz możliwości korzystania z uroków pobliskiej miejscowości Malindi nazywanej „małymi Włochami”. Hotel chwalony za ciepłą i rodzinną atmosferę.', '', 'wakacje-w-tamu-beach-resort-ex-stephanie-ocean-resort', '', '', '', 'Wakacje w Tamu Beach Resort (ex. Stephanie Ocean Resort)', '', '', '', ''),
(122, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(122, 1, 2, 'Niewątpliwie jednym z największych atutów tego hotelu jest jego położenie pomiędzy Parkiem Narodowym Watamu a siedliskiem rajskim ptaków zatoki Mida co sprawia, że Goście będą mogli wsłuchiwać się w piękne odgłosy przyrody i rozkoszować się wspaniałymi widokami. Wyśmienita kuchnia, profesjonalna obsługa, przepiękna rajska plaża – czy można chcieć więcej? Polecamy Gościom, którzy pragną aktywnie wypocząć w otoczeniu cudownej kenijskiej przyrody.', '', 'wakacje-w-temple-point-resort', '', '', '', 'Wakacje w Temple Point Resort', '', '', '', ''),
(123, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(123, 1, 2, 'Idealny hotel na rodzinne wakacje - bogaty wybór animacji i sportów, wygodny i różnorodny program All Inclusive oraz fantastyczna lokalizacja przy jednej z najpiękniejszych i najdłuższych plaż w Marsa Alam! Dodatkowy plus za nowo wyremontowane wnętrza i świetny serwis!', '', 'wakacje-w-three-corners-equinox-beach-resort', '', '', '', 'Wakacje w Three Corners Equinox Beach Resort', '', '', '', ''),
(124, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(124, 1, 2, 'Bardzo fajna wycieczka', '', 'wakacje-w-three-corners-rihana-inn', '', '', '', 'Wakacje w Three Corners Rihana Inn', '', '', '', ''),
(125, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(125, 1, 2, 'Bardzo dobra opcja na wakacje w gronie rodziny i przyjaciół. Hotel oferuje duży wybór animacji oraz usługi na najwyższym poziomie!', '', 'wakacje-w-three-corners-sunny-beach-resort', '', '', '', 'Wakacje w Three Corners Sunny Beach Resort', '', '', '', ''),
(126, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(126, 1, 2, 'Kompleks z doskonałą lokalizacją, blisko centrum Mombasy oraz z dostępem do wszelkich miejscowych rozrywek. Ze względu na bliskość farmy krokodyli i Parku Hallera polecamy go rodzinom z dziećmi i osobom chcącym odkrywać Mombasę na własną rękę. Duży wybór sportów przypadnie do gustu osobom aktywnym, amatorom windsurfingu i żeglarstwa. Miła, uczynna obsługa oraz dobra i urozmaicona kuchnia zapewnią komfortowy wypoczynek.', '', 'wakacje-w-travellers-beach-hotel--club', '', '', '', 'Wakacje w Travellers Beach Hotel & Club', '', '', '', ''),
(127, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(127, 1, 2, 'Komfortowy hotel, który przez lata działalności zaskarbił sobie sympatię i dobre opinie wśród Gości. Zlokalizowany nieopodal Parku Narodowego Marine, gdzie podczas snurkowania można podziwiać przepiękny świat podwodnej przyrody. Hotel polecamy głównie rodzinom z dziećmi ze względu na bogate animacje oraz przestronne pokoje.', '', 'wakacje-w-turtle-bay', '', '', '', 'Wakacje w Turtle Bay', '', '', '', ''),
(128, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(128, 1, 2, 'Wysokiej klasy obiekt przeznaczony dla najbardziej wymagających Klientów. Spokojna okolica, rozbudowana oferta rekreacyjna oraz szeroka oferta pielęgnacyjna w hotelowym spa – pomogą odpocząć i zrelaksować się podczas urlopu spędzonego w tym hotelu!', '', 'wakacje-w-two-ulysse-djerba-resort--thalasso', '', '', '', 'Wakacje w Two Ulysse Djerba Resort & Thalasso', '', '', '', ''),
(129, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(129, 1, 2, 'Komfortowy hotel o niezwykłej, wakacyjnej atmosferze, ukryty w zadbanym ogrodzie skąd rozpościera się przepiękny widok na okolicę. Główną zaletą hotelu jest położenie w pobliżu jednej z najpiękniejszych plaż wyspy – Anse Gaulette z drobnym, białym piaskiem. Ze względu na bogatą ofertę sportów oraz swobodnej atmosferze polecany jest na wakacje z rodziną lub grupą przyjaciół.', '', 'wakacje-w-valmer-resort', '', '', '', 'Wakacje w Valmer Resort', '', '', '', ''),
(130, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(130, 1, 2, 'Bardzo dobra propozycja dla rodzin z dziećmi oraz wszystkich szukających odrobiny spokoju, ze względu na lokalizację w zacisznej okolicy, z dala od kurortów turystycznych.', '', 'wakacje-w-vincci-rosa-beach-ex-sentido-rosa-beach', '', '', '', 'Wakacje w Vincci Rosa Beach (ex. Sentido Rosa Beach)', '', '', '', ''),
(131, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(131, 1, 2, 'Bardzo dobrej klasy hotel, stylizowany na okręt, który codziennie zabiera swoich Pasażerów do innego portu dzięki szerokiej ofercie sportowo-animacyjnej. Hotel cieszy się bardzo dobrymi opiniami Gości i chwalony jest szczególnie za dobrą kuchnię w bogatej formule All Inclusive. Doskonały wybór na beztroskie rodzinne wakacje czy wypad z przyjaciółmi! W naszej ofercie od wielu sezonów.', '', 'wakacje-w-voyager-beach', '', '', '', 'Wakacje w Voyager Beach', '', '', '', ''),
(132, 1, 1, '', '', '', '', '', '', '', '', '', '', '');
