(174, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(174, 1, 2, 'Rozległy resort z fantastycznym położeniem wprost na plaży i blisko Morro Branco. Uzupełnieniem do beztroskich wakacji są wszechobecne hamaki. Zapraszamy na leniwe wakacje w hamaku.', '', 'wakacje-w-coliseum-beach-resort', '', '', '', 'Wakacje w Coliseum Beach Resort', '', '', '', ''),
(175, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(175, 1, 2, 'Na szczególną uwagę zasługuje część plażowa hotelu z kompleksem basenów i mini aquaparkiem. Doskonale zorganizowane miejsce wypoczynkowe na samej plaży, świetnie zacienione przez ogród palmowy daje duże możliwości zarówno plażowania jak i relaksu w wodzie. Z autentycznych opinii Gości wynika, że jest to wysoko oceniany obiekt, serdecznie zapraszamy.', '', 'wakacje-w-crocobeach-hotel', '', '', '', 'Wakacje w Crocobeach Hotel', '', '', '', ''),
(176, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(176, 1, 2, 'Dom Pedro to wysokiej klasy, często wyróżniany obiekt. Najlepsze opinie Gości podkreślają doskonałą obsługę przystosowaną do różnych wymagań Gości a także jego doskonałą lokalizację, wprost na lagunie, przy rajskiej plaży. Hotel polecamy wymagajacym Klientom.', '', 'wakacje-w-dom-pedro-laguna-beach-resort--golf', '', '', '', 'Wakacje w Dom Pedro Laguna Beach Resort & Golf', '', '', '', ''),
(177, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(177, 1, 2, 'Największym atutem hotelu jest jego położenie, przy bardzo ładnej, białej plaży. Taras każdego pokoju wychodzi bezpośrednio na trawnik okalający basen. Z tarasu na plażę są przysłowiowe dwa kroki. Polecamy!', '', 'wakacje-w-golfinho-cumbuco', '', '', '', 'Wakacje w Golfinho Cumbuco', '', '', '', ''),
(178, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(178, 1, 2, 'Cała infrastruktura hotelu Kariri przylega bezpośrednio do białej, przępieknej plaży z wysokimi palmami. Zapierające dech w piersiach zachody słońca i widok na morze z basenu sprawią, że to będą Twoje niezapomniane wakacje!', '', 'wakacje-w-kariri-beach-cumbuco', '', '', '', 'Wakacje w Kariri Beach Cumbuco', '', '', '', ''),
(179, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(179, 1, 2, 'Warto zwrócić uwagę, że hotel oferuje świadczenia żywieniowe w kilku wersjach i można zakupić pakiet all inclusive light. Oferta warta polecenia z dwóch powodów, bliskości znajdujacego się w Księdze Rekordów Guinessa Parku Wodnego oraz bardzo atrakcyjnej ceny. Zapraszamy!', '', 'wakacje-w-laguna-blu-hotel', '', '', '', 'Wakacje w Laguna Blu Hotel', '', '', '', ''),
(180, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(180, 1, 2, 'Klimatyczny, kameralny hotel położony bezpośrednio na plaży. Dla żądnych przygód klientów polecamy położony w pobliżu olbrzymi Park Wodny. Zapraszamy!', '', 'wakacje-w-milos-beach-hotel', '', '', '', 'Wakacje w Milos Beach Hotel', '', '', '', ''),
(181, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(181, 1, 2, 'Bardzo ładny, przytulny hotel, położony w sercu znanego w całej Brazylii kurortu. Nowe, doskonale urządzone pokoje i wszędzie zaledwie dwa kroki, które najlepiej zrobić w klapkach lub zwyczajnie na boso. Polecamy Klientom ceniącym kontakt z przepiękną naturą oraz lubiącym świetne knajpki, kluby, muzykę na żywo i drinki kupowane wprost na ulicy', '', 'wakacje-w-my-blue-jericoacoara', '', '', '', 'Wakacje w My Blue Jericoacoara', '', '', '', ''),
(182, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(182, 1, 2, 'Hotel z fantastycznym położeniem, wprost na plaży, dysponuje obszerną przestrzenią do wypoczynku, rozbudowanym kompleksem basenów ze zjeżdżalniami i pełną kolorów strefą dla dzieci. Całość uzupełnia wygodny all inclusive i bardzo przystępna cena. Gorąco polecamy.', '', 'wakacje-w-parque-das-fontes', '', '', '', 'Wakacje w Parque das Fontes', '', '', '', ''),
(183, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(183, 1, 2, 'Gorąco polecamy pobyt w uroczym miejscu pośród wydm i lagun jakim jest Jericoacoara. Na genialne wakacje w Jeri składa się super plażowanie na lagunach, klimatyczne zachody słońca na wydmach, świetne zakupy w lokalnych sklepach i zabawa do rana w jednej z małych klimatycznych kanjpek urządzonych po prostu na piasku. Małe pousady z hamakami na tarasie na stałe wpisały się w klimat tego miejsca.', '', 'wakacje-w-pousada-surfing-jeri', '', '', '', 'Wakacje w Pousada Surfing Jeri', '', '', '', ''),
(184, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(184, 1, 2, 'Hotel jest świeżo po rekonstrukcji w 2016 roku. Oprócz wygodnych, nowoczesnych pokoi posiada to coś, co trudno nazwać a jest bardzo ważne: dobry klimat, fajną atmosferę i piękny widok na magiczną Copacabanę oraz Głowę Cukru. Trudno sobie wyobrazić lepszą lokalizację hotelu w Rio. Polecamy dla wymagających Klientów.', '', 'wakacje-w-rio-othon-palace', '', '', '', 'Wakacje w Rio Othon Palace', '', '', '', ''),
(185, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(185, 1, 2, 'Bardzo dobry wybór dla Klientów pragnących spędzić wakacje w dzielnicy Copacabana i nie wydać zbyt dużo. Ekonomiczna wersja sieci Othon zapewni Państwu zarówno świetna lokalizację, bardzo miły, pomocny personel oraz co ważne, niezbyt wygórowaną cenę. Świetna oferta dla Klientów, którzy zamierzają dużo zwiedzać.', '', 'wakacje-w-savoy-othon', '', '', '', 'Wakacje w Savoy Othon', '', '', '', ''),
(186, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(186, 1, 2, 'Hotel Sheraton zapewnie spełni oczekiwania najbardziej wymagających Klientów. Warto zaznaczyć, że Sheraton, jako jeden z niewielu obiektów w Brazylii oferuje pełną opcję All Inclusive.', '', 'wakacje-w-sheraton-grand-rio', '', '', '', 'Wakacje w Sheraton Grand Rio', '', '', '', ''),
(187, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
