(228, 1, 2, 'Nie najnowszy hotel 4* z podstawowymi, ale funkcjonalnie wyposażonymi pokojami, nastawiony głównie na młodych ludzi, którzy lubią się bawić przy kubańskich rytmach oraz dla miłośników plażowania - to tutaj znajduje się najpiękniejszy odcinek plaży w Varadero!', '', 'wakacje-w-allegro-palma-real', '', '', '', 'Wakacje w Allegro Palma Real', '', '', '', ''),
(229, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(229, 1, 2, 'Fantastyczna wioska wakacyjna z niespotykanie bogatą infrastrukturą rekreacyjną i sportową, która przypadnie do gustu i małym i dużym. Jako bonusy - pobliska rafa i delfinarium. Hotel chwalony za bogate wyżywienie i wysokiej klasy serwis. Polecamy!', '', 'wakacje-w-barcelo-maya-grand-resort', '', '', '', 'Wakacje w Barcelo Maya Grand Resort', '', '', '', ''),
(230, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(230, 1, 2, 'Nie najnowsze, ale bardzo zadbane i godne polecenia 4*. Plusem hotelu są duże pokoje, basen i tropikalny ogród oraz oczywiście karaibska plaża i świetny serwis. Jeden z najlepiej sprzedających się hoteli w ofercie Rainbow w Varadero.', '', 'wakacje-w-be-live-experience-turquesa', '', '', '', 'Wakacje w Be Live Experience Turquesa', '', '', '', ''),
(231, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(231, 1, 2, 'Przepięknie położony, bardzo dobry hotel, wielokrotnie nagradzany w różnorodnych rankingach. Wyśmienite jedzenie, przyjazna obsługa, liczne atrakcje, to gwarancja udanego urlopu. Polecamy zarówno parom jak i rodzinom z dziećmi. Pięć gwiazdek w atrakcyjnej cenie!', '', 'wakacje-w-bluebay-grand-esmeralda', '', '', '', 'Wakacje w Bluebay Grand Esmeralda', '', '', '', ''),
(232, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(232, 1, 2, 'Kameralny (tylko 132 pokoje) hotel z porządnymi pokojami i miłą obsługą. W 2017 roku w hotelu zostały odświeżone pokoje, strefa basenowa oraz restauracje. Hotel raczej na wakacje we dwoje lub w grupie znajomych (brak infrastruktury dla dzieci).', '', 'wakacje-w-cancun-bay-resort', '', '', '', 'Wakacje w Cancun Bay Resort', '', '', '', ''),
(233, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(233, 1, 2, 'Fantastyczny czterogwiazdkowy hotel z wieloma atrakcjami zarówno dla najmłodszych jak i dorosłych.\"+\" za świetne wyżywienie. Ładne pokoje oraz wiele możliwości aktywnego spędzania czasu wolnego to największe atuty tego hotelu. Zapraszamy!', '', 'wakacje-w-catalonia-yucatan-beach', '', '', '', 'Wakacje w Catalonia Yucatan Beach', '', '', '', ''),
(234, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(234, 1, 2, 'Gruntownie odświeżone w 2014 roku pokoje, sympatyczna obsługa, smaczne wyżywienie, dwa baseny i ładny ogród – wszystko to składa się na porządne ***. Jeśli połączymy to z miękkim, białym piaskiem oraz kąpielami w ciepłym morzu, to otrzymamy odpowiednią scenerię karaibskich wakacji.', '', 'wakacje-w-dos-playas-beach-house-by-faranda', '', '', '', 'Wakacje w Dos Playas Beach House by Faranda', '', '', '', ''),
(235, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(235, 1, 2, 'Bardzo dobry hotel sygnowany marką Dreams i hasłem Unlimited-Luxury®. Wygodne pokoje, fantastyczna lokalizacja oraz bogate wyżywienie. Do tego nieziemskie kolory Morza Karaibskiego, biały piasek i delfinarium. Uwielbiany przez pary, ale polecany również dla rodzin z dziećmi, chcących spędzić romantyczne wakacje w luksusie.', '', 'wakacje-w-dreams-puerto-aventuras-resort--spa', '', '', '', 'Wakacje w Dreams Puerto Aventuras Resort & Spa', '', '', '', ''),
(236, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(236, 1, 2, 'Luksusowa oaza dla par oraz rodzin z dziećmi. Szeroki zakres all inclusive pozwala poczuć atmosferę prawdziwie beztroskich wakacji, gdzie priorytetem jest relaks w promieniach karaibskiego słońca. Hotel idealny zarówno na słodkie lenistwo jak i aktywne wakacje. Idealna propozycja dla osób które docenią doskonałe restauracje serwujące dania z różnych stron świata. Jednym z wielu atutów tego hotelu są nowoczesne, dopracowane w najdrobniejszych szczegółach wnętrza.', '', 'wakacje-w-dreams-riviera-cancun-resort--spa', '', '', '', 'Wakacje w Dreams Riviera Cancun Resort & Spa', '', '', '', ''),
(237, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(237, 1, 2, 'Luksusowy hotel utrzymany w oryginalnym stylu meksykańskiej hacjendy. Uwielbiany przez pary, ale polecany również dla rodzin z dziećmi. Biała, szeroka plaża, turkusowa woda Morza Karaibskiego wraz z bogatą ofertą hotelu sygnowaną Unlimited-Luxury® stanowią idealne połączenie dla Klientów poszukujących niezapomnianych wakacji w luksusowym kurorcie.', '', 'wakacje-w-dreams-tulum-resort--spa', '', '', '', 'Wakacje w Dreams Tulum Resort & Spa', '', '', '', ''),
(238, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(238, 1, 2, 'Liczne baseny, bogata infrastruktura, entuzjastycznie nastawiona obsługa, bogaty program animacyjny powodują, że nie sposób się tu nudzić, a bogate menu z pewnością trafi w gusta wymagających Klientów. Jako bonus - ku uciesze najmłodszych Gości - park wodny i delfinarium.', '', 'wakacje-w-grand-bahia-principe-riviera-maya', '', '', '', 'Wakacje w Grand Bahia Principe Riviera Maya', '', '', '', ''),
(239, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(239, 1, 2, 'Jedno z najkorzystniejszych cenowo 5* w naszej ofercie! Polecamy każdemu- zarówno rodzinom z dziećmi jak i osobom dorosłym ceniącym spokój - strefa Sanctuary to idealne miejsce na relaks z dala od najmłodszych Gości.', '', 'wakacje-w-grand-memories-varadero', '', '', '', 'Wakacje w Grand Memories Varadero', '', '', '', ''),
(240, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(240, 1, 2, 'Ogromna wioska wakacyjna z bogatą infrastrukturą - różnorodne pokoje, 29 restauracji i barów, strefy basenowe o łącznej powierzchni blisko 1 ha, liczne aktywności, dobrej klasy serwis. Odpowiednie miejsce i na rodzinny wypoczynek i na relaks we dwoje. Dla najmłodszych basen ze zjeżdżalniami i animacje, dla dorosłych basen ukryty w jukatańskiej selwie. Polecamy!', '', 'wakacje-w-grand-palladium-riviera-maya-resort--spa', '', '', '', 'Wakacje w Grand Palladium Riviera Maya Resort & Spa', '', '', '', ''),
(241, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(241, 1, 2, '\"Wakacje w Grand Riviera &amp; Suites Princess\"', '', 'wakacje-w-grand-riviera--suites-princess', '', '', '', '\"Wakacje w Grand Riviera & Suites Princess\"', '', '', '', '');
