(242, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(242, 1, 2, 'Hotel jest idealną propozycją dla Klientów ceniących wysoki standard z jednoczesnym zachowaniem rodzinnej, wakacyjnej atmosfery. Wspaniała, bajeczna lokalizacja, życzliwa obsługa, świetny serwis, wyśmienite jedzenie, wiele opcji dla Najmłodszych gwarantujących niezapomnianą zabawę oraz możliwość relaksu dla dorosłych. Wszystko to sygnowane marką Iberostar.', '', 'wakacje-w-iberostar-selection-cancun--coral-level-at-iberostar-selection-cancun', '', '', '', 'Wakacje w IBEROSTAR Selection Cancun & Coral Level At IBEROSTAR Selection Cancun', '', '', '', ''),
(243, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(243, 1, 2, 'Hotel Iberostar Costa Dorada zapewnia gościom relaks na wysokim poziomie. Bogaty program animacji oraz zróżnicowana oferta sportowa dla dzieci i dorosłych umili pobyt wszystkim wczasowiczom. Różnorodna oferta hotelowych restauracji oraz barów zadowli wszystkich smakoszy. Doskonały na rodzinne wakacje!', '', 'wakacje-w-iberostar-costa-dorada', '', '', '', 'Wakacje w Iberostar Costa Dorada', '', '', '', ''),
(244, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(244, 1, 2, 'Fantastyczna wioska wakacyjna idealna nie tylko na rodzinny wypoczynek. Ogromny (35 ha) ogród i basen (mówi się, że największy na całym Riviera Maya), komfortowe pokoje, bogate wyżywienie i różnorodne aktywności to wizytówki sieci Iberostar. Gorąco polecamy!', '', 'wakacje-w-iberostar-paraiso-del-mar', '', '', '', 'Wakacje w Iberostar Paraiso del Mar', '', '', '', ''),
(245, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(245, 1, 2, 'Kolejna w naszej ofercie, idealna na zimowe wakacje propozycja marki Iberostar. Na Gości czekają wygodne pokoje, świetne wyżywienie oraz doskonała obsługa. Jest to jedyny 5* hotel w naszej ofercie położony blisko tętniącego życiem kurortu Riviera Maya - Playa del Carmen. Zapraszamy!', '', 'wakacje-w-iberostar-quetzal', '', '', '', 'Wakacje w Iberostar Quetzal', '', '', '', ''),
(246, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(246, 1, 2, 'Jeden z nowszych hoteli w całym Varadero. Hotel doceniany przez naszych Klientów za przestronne i dobrze utrzymane pokoje oraz strefę Elite sygnowaną marką Iberostar. Zapraszamy!', '', 'wakacje-w-iberostar-selection-bella-vista', '', '', '', 'Wakacje w Iberostar Selection Bella Vista', '', '', '', ''),
(247, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(247, 1, 2, 'Od wielu lat znajdujący się w czołówce najlepiej sprzedających się hoteli w Varadero, ceniony za świetny serwis, wyżywienie oraz ciekawe zaaranżowane wnętrza. Aquapark i baseny oraz animacje z pewnością docenią Mali Goście, dla Dorosłych - zabiegi w hotelowym Spa, różnorodna infrastruktura sportowa oraz relaks na karaibskiej plaży.', '', 'wakacje-w-iberostar-selection-varadero', '', '', '', 'Wakacje w Iberostar Selection Varadero', '', '', '', ''),
(248, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(248, 1, 2, 'Bardzo dobre 4*, kameralny hotel polecany rodzinom z dziećmi ze względu na przestronne pokoje, różnorodnę infrastrukturę, świetny serwis i bogate animacje, za które przyznajemy hotelowi dodatkowy \"+\".', '', 'wakacje-w-iberostar-tainos', '', '', '', 'Wakacje w Iberostar Tainos', '', '', '', ''),
(249, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(249, 1, 2, 'Hotel o bardzo wysokim standardzie, gdzie każdy poczuje się wyjątkowo. Bogata oferta basenów, przepiękna, długa plaża idealna do spacerów, wypełniający cały teren ogród poprzeplatany uroczymi alejkami zapewnią upragniony wypoczynek oraz relaks. Szukający wrażeń z pewnością ucieszą liczne sportowe udogodnienia oraz rozbudowany program animacyjny. Mnogość restauracji i barów serwujących dania oraz drinki z całego świata zagwarantują prawdziwą ucztę dla podniebienia. Całość dopełnia entuzjastycznie nastawiony i zawsze gotowy do pomocy personel hotelowy. Niewątpliwą zaletą są wydzielone strefy tylko dla osób dorosłych.', '', 'wakacje-w-luxury-bahia-principe-akumal', '', '', '', 'Wakacje w Luxury Bahia Principe Akumal', '', '', '', ''),
(250, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(250, 1, 2, 'Ekskluzywny, pięciogwiazdkowy hotel usytuowany przy malowniczej, karaibskiej plaży to odpowiednia propozycja zarówno dla rodzin z dziećmi jak i osób dorosłych (strefa Level dla Klientów powyżej 18 roku życia)- mnogość atrakcji, udogodnienia dla najmłodszych, bogata oferta gastronomiczna (kilkanaście barów i restauracji), duże strefy basenowe to jedynie niektóre z atutów kompleksu. Gwarancja jakości sygnowana marką sieci Melia. Gorąco polecamy!', '', 'wakacje-w-melia-internacional', '', '', '', 'Wakacje w Melia Internacional', '', '', '', ''),
(251, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(251, 1, 2, 'Porządna 4* wioska wakacyjna, w kolonialnym stylu, otoczona tropikalną roślinnością. Kompleks dedykowany przede wszystkim rodzinom, niemniej pary i grupy znajomych spędzą tu również przyjemnie czas. \"+\" za szeroką plażę i bogatą (jak na 4*) infrastrukturę. Do tego bardzo atrakcyjna cena!', '', 'wakacje-w-memories-varadero-beach-resort', '', '', '', 'Wakacje w Memories Varadero Beach Resort', '', '', '', ''),
(252, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(252, 1, 2, 'Zadbany, pięknie położony hotel oferujący atrakcje zarówno dla dorosłych, jak i najmłodszych Gości. Wyśmienite wyżywienie, przestronne i eleganckie pokoje oraz najwyższej klasy serwis, to gwarancja udanego wypoczynku pod hasłem Unlimited-Luxury®.', '', 'wakacje-w-now-jade-riviera-cancun', '', '', '', 'Wakacje w Now Jade Riviera Cancun', '', '', '', ''),
(253, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(253, 1, 2, 'Tropikalna posiadłość wakacyjna z bardzo bogatą infrastrukturą dla każdego malowniczo położona pośród tropikalnej zieleni. Wyśmienite wyżywienie, eleganckie pokoje oraz najwyższej klasy serwis, to gwarancja udanego wypoczynku pod hasłem Unlimited-Luxury®.', '', 'wakacje-w-now-sapphire-riviera-cancun', '', '', '', 'Wakacje w Now Sapphire Riviera Cancun', '', '', '', ''),
(254, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(254, 1, 2, 'Nowoczesny hotel z ciekawym designem, spełniający oczekiwania wymagających Klientów. Dodatkowe atuty to malownicze położenie na klifie pomiędzy dwoma plażami oraz pokoje privilege o podwyższonym serwisie. Polecamy!', '', 'wakacje-w-ocean-vista-azul', '', '', '', 'Wakacje w Ocean Vista Azul', '', '', '', ''),
(255, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(255, 1, 2, 'Jeden z najlepszych hoteli w naszej ofercie. Idealny dla osób dorosłych, które chcą spędzić wakacje w wysmakowanej atmosferze spokoju, a bliskość mariny zachęca do spacerów w karaibskiej bryzie.', '', 'wakacje-w-paradisus-princesa-del-mar', '', '', '', 'Wakacje w Paradisus Princesa del Mar', '', '', '', ''),
(256, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(256, 1, 2, 'Zadbany, położony nad samym brzegiem morza hotel do 2017 roku należący do znanej sieci hotelowej Riu a obecnie zarządzany przez hiszpańską sieć Senator Hotels Resorts. Otoczony tropikalnym ogrodem o powierzchni 45 tys. m2 jest idealnym miejscem na idylliczny, wakacyjny wypoczynek we dwoje, a bogata oferta animacji dla dorosłych i dzieci zapewni udany urlop z rodziną. Urozmaicona kuchnia i wybór hotelowych restauracji i barów pozwoli cieszyć się znakomitymi lokalnymi przysmakami. Serdecznie polecamy!', '', 'wakacje-w-playa-bachata-resort', '', '', '', 'Wakacje w Playa Bachata Resort', '', '', '', ''),
(257, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(257, 1, 2, 'Bardzo nowocześnie urządzony, jeden z najlepszych hoteli w strefie hotelowej Cancun, oferujący wypoczynek pod hasłem Unlimited-Luxury®. Eleganckie i komfortowe pokoje z fantastycznym widokiem na ocean i lagunę, doskonałe restauracje a’la carte, serwis na najwyższym poziomie oraz szeroki wybór zabiegów Spa by Pevonia to wizytówki hotelu. Idealne miejsce na relaks we dwoje.', '', 'wakacje-w-secrets-the-vine-cancun', '', '', '', 'Wakacje w Secrets The Vine Cancun', '', '', '', ''),
(258, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(258, 1, 2, 'Kameralny, położony pośród selwy, z wygodnymi namiotami w stylu safari, z bardzo dobrą obsługą oraz wyżywieniem bazującym na lokalnych produktach – doskonale wpisujący się w założenia hotelu przyjaznego naturze. Plus za ciszę, spokój i przepiękną plażę. Glamping w karaibskim wydaniu.', '', 'wakacje-w-serenity-eco-luxury-tented-camp-by-xperience', '', '', '', 'Wakacje w Serenity Eco Luxury Tented Camp by Xperience', '', '', '', ''),
(259, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(259, 1, 2, 'Idealne miejsce na rodzinny wypoczynek! Dorośli na pewno docenią restuauracje i przeznaczoną tylko dla nich strefę Sun Club, a najmłodsi poczują się wyjątkowo podczas specjalnie spersonalizowanego check in i nawiążą nowe znajomości w klubach dla dzieci i młodzieży. Do tego bardzo atrakcyjna cena za bardzo dobrą jakość. Polecamy!', '', 'wakacje-w-sunscape-akumal-beach-resort--spa', '', '', '', 'Wakacje w Sunscape Akumal Beach Resort & Spa', '', '', '', ''),
(260, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(260, 1, 2, 'Hotel zarówno na rodzinny wypoczynek jak i na urlop we dwoje. Ceniony za dobrze utrzymane wnętrza i strefę privilege przeznaczoną tylko dla osób dorosłych. Do tego bungalowowa zabudowa w otoczeniu tropikalnego ogrodu tworzą iście karaibski klimat! Zapraszamy!', '', 'wakacje-w-valentin-el-patriarca-varadero--ex-ocean-varadero-el-patriarca', '', '', '', 'Wakacje w Valentin El Patriarca Varadero  (ex. Ocean Varadero El Patriarca)', '', '', '', ''),
(261, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(261, 1, 2, 'Elegancki i luksusowy hotel, plus za bogatą formułę All Inclusive, która będzie dopełnieniem beztroskich wakacji. Położenie w tej części wybrzeża stanowi idealne miejsce do długich spacerów w rajskiej scenerii. Polecamy parom spragnionym spokojnego acz aktywnego relaksu, gdyż hotel przeznaczony jest tylko dla osób dorosłych.', '', 'wakacje-w-viva-wyndham-v-samana', '', '', '', 'Wakacje w Viva Wyndham V Samana', '', '', '', ''),
(262, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(262, 1, 2, 'Panama (Colon) - gdzie Pacyfik łączy się z Atlantykiem • Kolumbia (Cartagena de Indias) - w rytmie salsy • Curacao – kolorowe domy i likiery • Bonaire – dziewicze rafy koralowe • Aruba – białe plaże i turkusowa woda • statek Monarch **** all inclusive - polski pilot na pokładzie statku', '', 'wycieczka-antyle-i-karaiby-poudniowe---rejs', '', '', '', 'Wycieczka Antyle i Karaiby Południowe - Rejs', '', '', '', ''),
(263, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(263, 1, 2, 'Magiczna Hawana i Hemingway • jedyna była francuska kolonia na Kubie • Cienfuegos • Trynidad - miasto, w którym zatrzymał się czas • prawdziwe cygara i rum • Santiago de Cuba - muzyczna stolica wyspy • daleki wschód - Baracoa • wypoczynek w Varadero (all inclusive)', '', 'wycieczka-buenos-dias-cuba', '', '', '', 'Wycieczka Buenos Dias Cuba', '', '', '', ''),
(264, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(264, 1, 2, 'Dominikana – rajska wyspa ● Puerto Plata – bursztynowa stolica wyspy ● fabryka rumu i cygar ● Santo Domingo – poczuj zmysłami stolicę ● Los Tres Ojos - magiczny świat jaskiń ● Altos de Chavon – miasto zbudowane z koralowca ● wyspa Saona – najpiękniejsze plaże Karaibów ● Higuey – dominikańska Częstochowa ● Punta Cana – luksus na wyciągnięcie ręki ● Samana i wodospad El Limon – prawdziwy raj na ziemi ● wypoczynek w hotelach nad morzem', '', 'wycieczka-karaibska-licznotka', '', '', '', 'Wycieczka Karaibska ślicznotka', '', '', '', ''),
(265, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(265, 1, 2, 'Magiczna Hawana i Hemingway • Che Guevara i początki rewolucji • przejażdżka starymi autami i • kolonialne Cienfuegos • niepowtarzalna atmosfera Trynidadu • prawdziwe cygara i rum • wypoczynek w Varadero!', '', 'wycieczka-kuba---wyspa-jak-wulkan-gorca', '', '', '', 'Wycieczka Kuba - Wyspa jak wulkan gorąca', '', '', '', ''),
(266, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(266, 1, 2, 'Kubańska salsa w praktyce!- muzyczne dziedzictwo Starej Hawany –magiczna Fusterlandia - Park Narodowy Las Terrazas - kolonialny Trynidad i Cienfuegos – wypoczynek na pięknych plażach Morza Karaibskiego.', '', 'wycieczka-salsa-cubana', '', '', '', 'Wycieczka Salsa cubana', '', '', '', ''),
(267, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(267, 1, 2, 'Dubaj - miasto idealne • Melbourne – kulturalna i sportowa stolica Australii • Alice Springs - czerwony środek Australii • Kings Canyon - dno morskie na pustyni • Ayers Rock - Uluru - święta góra Aborygenów • Sydney - opera i most portowy • Park Narodowy Blue Mountains z Three Sisters • wypoczynek na Gold Coast - australijskie Miami • Brisbane – stolica stanu Queensland', '', 'wycieczka-australia-open-', '', '', '', 'Wycieczka Australia Open !', '', '', '', ''),
(268, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(268, 1, 2, 'Dubaj – najpopularniejsze miasto Zjednoczonych Emiratów Arabskich • Melbourne i Alice Springs - najpiękniejsze miasta Australii • Barossa - dolina wina • Kings Canyon – czerwony środek Australii • Ayers Rock - Uluru - święta góra Aborygenów • Sydney - opera i most portowy • Blue Mountains i Three Sisters •rejs po zatoce Botany Bay do Manly z piękną plażą i historyczną zabudową • Nowa Zelandia – obie wyspy • Park Narodowy z górą Cooka - najwyższym szczytem Nowej Zelandii • Fiord Milford Sound i Morze Tasmana • Wellington - stolica Nowej Zelandii • Auckland - największe miasto Nowej Zelandii • rozgrzana Rotorua • Hobbiton - spotkanie z hobbitami • Waitomo - rozgwieżdżone niebo w jaskiniach.', '', 'wycieczka-od-a-do-z', '', '', '', 'Wycieczka Od A do Z', '', '', '', ''),
(269, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(269, 1, 2, 'Dubaj – orientalny blichtr • Sydney - opera i most portowy • Park Narodowy Blue Mountains z Three Sisters • Ayers Rock - Uluru - święta góra Aborygenów • Cairns - wielka rafa koralowa i las deszczowy • kiwi - oko w oko z ptakiem nielotem • Rotorua - stąd już blisko do piekła • Hobbiton - spotkanie z hobbitami • Brisbane - stolica stanu Queensland • Wellington - stolica Nowej Zelandii - kraju na końcu świata • Waitomo - rozgwieżdżone niebo w jaskiniach.', '', 'wycieczka-po-drugiej-stronie-ziemi', '', '', '', 'Wycieczka Po drugiej stronie Ziemi', '', '', '', ''),
(270, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(270, 1, 2, 'Dubaj i Singapur – zwiedzanie obu miast i noclegi tranzytowe • Melbourne – kulturalna i sportowa stolica Australii • Sydney • Milford Sound - fiord na Morzu Tasmana • Arrowtown - w poszukiwaniu złota • Twizel - stolica łososia • Góra Cooka i nowozelandzkie Alpy • kiwi - oko w oko z ptakiem nielotem • Rotorua - stąd już blisko do piekła • Waitomo - rozgwieżdżone niebo w jaskiniach • odpoczynek na rajskiej Fidżi', '', 'wycieczka-pocztwka-z-koca-wiata', '', '', '', 'Wycieczka Pocztówka z końca Świata', '', '', '', ''),
(271, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(271, 1, 2, 'Hongkong, Singapur - miasta drapaczy chmur • Makau - miasto kasyn • Sydney - opera i most portowy • rejs po zatoce Botany Bay • oko w oko z kangurami i koalą • Park Narodowy Blue Mountains z Three Sisters • Rotorua - stąd już blisko do piekła • kiwi - spotkanie z ptakiem nielotem • Hobbiton - spotkanie z hobbitami • Waitomo - rozgwieżdżone niebo w jaskiniach • Auckland - miasto na przesmyku • Samoa i Fidżi - relaks i piękne plaże •', '', 'wycieczka-wyspy-pacyfiku---zagubiony-raj', '', '', '', 'Wycieczka Wyspy Pacyfiku - zagubiony raj', '', '', '', ''),
(272, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(272, 1, 2, 'Elegancki hotel położony wśród tarasowych pól ryżowych, a jednocześnie niedaleko centrum Ubud. Malownicze krajobrazy i klimatyczna okolica zachwycą każdego, kto chciałby poznać prawdziwe oblicze Bali.', '', 'wakacje-w-alaya-ubud', '', '', '', 'Wakacje w Alaya Ubud', '', '', '', ''),
(273, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(273, 1, 2, '\"Wakacje w Amaya Resort &amp; Spa Kuda Rah\"', '', 'wakacje-w-amaya-resort--spa-kuda-rah', '', '', '', '\"Wakacje w Amaya Resort & Spa Kuda Rah\"', '', '', '', ''),
(274, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(274, 1, 2, 'Wyjątkowo elegancki hotel należący do sieci hoteli Santika, co dodatkowo jest gwarancją standardu i jakości świadczonych usług. Hotel wyróżnia się smaczną i różnorodną kuchnią. Dodatkowym atutem jest położenie tuż przy plaży, w niewielkiej odległości od rozrywek miejscowości Kuta. Szczególnie polecamy wymagającym Klientom oraz parom pragnącym spędzić romantyczne, luksusowe wakacje.', '', 'wakacje-w-anvaya-beach-resort', '', '', '', 'Wakacje w Anvaya Beach Resort', '', '', '', ''),
(275, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(275, 1, 2, 'Hotel dla wymagających klientów, polecany szczególnie osobom poszukującym odpoczynku z dala od tłocznych kurortów, a jednocześnie blisko plaży. Jedna z najlepszych plaż na Bali - polecamy.', '', 'wakacje-w-ayodya', '', '', '', 'Wakacje w Ayodya', '', '', '', ''),
(276, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(276, 1, 2, 'Znany z dobrej kuchni hotel położony w tropikalnym ogrodzie tuż przy piaszczystej plaży jest idealnym miejscem dla osób spragnionych relaksu. Lokalizacja obiektu zapewnia zapierające dech w piersiach widoki oraz możliwość skorzystania z uroków pobliskich miejscowości.', '', 'wakacje-w-bali-tropic', '', '', '', 'Wakacje w Bali Tropic', '', '', '', ''),
(277, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(277, 1, 2, 'Sympatyczny hotel, przepięknie położony wśród tropikalnej roślinności. Idealna propozycja dla osób poszukujących rajskich krajobrazów, białych plaż, lagun w rozsądnej cenie. Możliwości skorzystania z szerokiej oferty sportów wodnych czy nurkowania.', '', 'wakacje-w-biyadhoo-island-resort', '', '', '', 'Wakacje w Biyadhoo Island Resort', '', '', '', ''),
(278, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(278, 1, 2, 'Ekonomiczny hotel z przyjazną i pomocną obsługą, położony w spokojnym, harmonijnym otoczeniu. Polecany szczególnie gościom ceniącym miłą atmosferę oraz ciche miejsca, ale także łatwy dostęp do wielu rozrywek uatrakcyjniających pobyt.', '', 'wakacje-w-camakila-tanjung-benoa-ex-tanjung-benoa-resort', '', '', '', 'Wakacje w Camakila Tanjung Benoa (ex Tanjung Benoa Resort)', '', '', '', ''),
(279, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(279, 1, 2, 'Bardzo dobrej klasy hotel położony na niewielkiej, ale bardzo urokliwej wyspie. Eleganckie pokoje, wspaniała obsługa oraz szeroki wybór atrakcji na terenie hotelu sprawia, że to doskonały wybór na niezapomniane rajskie wakacje we dwoje lub w gronie rodziny. Bardzo bogata formuła All Inclusive. Idealne miejsce dla osób nastawionych na odkrywanie podwodnego świata oraz amatorów sportów wodnych.', '', 'wakacje-w-centara-grand-island-resort--spa-maldives', '', '', '', 'Wakacje w Centara Grand Island Resort & Spa Maldives', '', '', '', ''),
(280, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(280, 1, 2, 'Bardzo dobry hotel ze świetną lokalizacją dla poszukujących odpoczynku z dala od tłocznych kurortów. Idealny wybór zarówno dla rodzin z dziećmi, jak i dla par spędzających romantyczny urlop. Jeden z niewielu hoteli oferujących all inclusive na wyspie - polecamy!', '', 'wakacje-w-grand-mirage', '', '', '', 'Wakacje w Grand Mirage', '', '', '', ''),
(281, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
