(327, 1, 2, 'Rewelacyjnie położony na słynnej wyspie Palm Jumeirah z fantastycznymi widokami na kosmopolityczny Dubaj. Cieszący się bardzo dobrymi opiniami ze względu na wysoki poziom usług i wyśmienite zaplecze rekreacyjne hotel, łączy w sobie komfort i luksus. Ciesz się plażą, zabawą i słońcem w jednym miejscu!', '', 'wakacje-w-royal-central-the-palm', '', '', '', 'Wakacje w Royal Central The Palm', '', '', '', ''),
(328, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(328, 1, 2, 'Jeden z najdłużej działających hoteli w Abu Dhabi, który przez lata zaskarbił sobie sympatię gości, głównie dzięki rewelacyjnemu serwisowi oraz wyśmienitej kuchni. Polecamy gościom, którzy poszukują wypoczynku w luksusowych wnętrzach, z dostępem do jednej z najładniejszych plaż w tej części stolicy, a jednocześnie w pobliżu atrakcji oferowanych przez Abu Dhabi.', '', 'wakacje-w-sheraton-abu-dhabi-hotel-and-resort', '', '', '', 'Wakacje w Sheraton Abu Dhabi Hotel and Resort', '', '', '', ''),
(329, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(329, 1, 2, 'Wymarzone miejsce na niezwykłe wakacje. Doskonały hotel znanej marki i wysoki standard obsługi to gwarancja świetnego wypoczynku. Idealny dla wszystkich, którzy szukają połączenia luksusu ze znakomitą lokalizacją - w pobliżu plaży i tętniącego życiem miasta. Serdecznie polecamy!', '', 'wakacje-w-sheraton-jumeirah', '', '', '', 'Wakacje w Sheraton Jumeirah', '', '', '', ''),
(330, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(330, 1, 2, 'Wypoczynek w Aqabie - kurorcie Królestwa Jordanii (2 dni) • Petra - zabytek UNESCO • Wypoczynek nad Morzem Martwym (2 dni) • Betania - mejsce chrztu Jezusa Chrystusa • Góra Nebo • Dla chętnych możliwość przedłużenia o 7 dni wypoczynku w Aqabie!', '', 'wycieczka-dwa-morza', '', '', '', 'Wycieczka Dwa morza', '', '', '', ''),
(331, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(331, 1, 2, 'Sharm el Sheikh - kurort Synaju • Wadi Rum - królowa pustyń • Petra • góra Nebo - ostatnie spojrzenie Mojżesza • Betlejem • Dżerasz - miasto 600 kolumn • rzeka Jordan • Jezioro Galilejskie • Cezarea Nadmorska • Jaffa-Tel Aviv • Jerozolima • opcjonalnie tydzień pobytu w Sharm el Sheikh', '', 'wycieczka-egipt-jordania-izrael--bliskowschodni-tercet', '', '', '', 'Wycieczka Egipt, Jordania, Izrael – bliskowschodni tercet', '', '', '', ''),
(332, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(332, 1, 2, 'Dubaj - największe i najdroższe budowle świata • Abu Zabi - stolica Emiratów i największy meczet • Emirat Szardża - perła Zatoki • orientalne souki pełne złota • Ferrari World (fakultatywnie) • relaks nad Oceanem Indyjskim w Fudżajra • opcjonalnie tydzień wypoczynku w Emiratach Arabskich', '', 'wycieczka-przygoda-z-szejkiem', '', '', '', 'Wycieczka Przygoda z szejkiem', '', '', '', ''),
(333, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(333, 1, 2, 'Wypoczynek w Aqabie - kurorcie Królestwa Jordanii (2 dni) • pustynia Wadi Rum - niezwykła dolina leżąca wśród skał • Petra - skarb UNESCO • Amman - stolica Jordanii • Góra Nebo • Dla chętnych możliwość przedłużenia o 7 dni wypoczynku w Aqabie!', '', 'wycieczka-the-best-of-jordan', '', '', '', 'Wycieczka The best of Jordan', '', '', '', ''),
(334, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(334, 1, 2, 'Prężnie działający hotel położony w centrum Playa de las Americas i jeden z najlepszych 4* hoteli w kurorcie. Na Klientów czekają dwa spore baseny, dobrze wyposażona siłownia i relaksujące spa, bardzo dobry serwis i przyjemne pokoje. Hotel prowadzi różnorodne animacje, doceniane przez Klientów.', '', 'wakacje-w-alexandre-gala', '', '', '', 'Wakacje w ALEXANDRE Gala', '', '', '', ''),
(335, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(335, 1, 2, 'Wyremontowany w 2018 roku, nowoczesny i stylowy hotel, z przestronnymi i gustownymi pokojami różnego typu. Położony niedaleko promenady (ok. 500), która łączy dzielnicę Lido z kamienistą plażą Formosa, i z której roztaczają się piękne widoki również na klif Cabo Girao.', '', 'wakacje-w-alto-lido', '', '', '', 'Wakacje w Alto Lido', '', '', '', ''),
(336, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(336, 1, 2, 'Nowoczesny i elegancki hotel położony w spokojnej okolicy – idealny dla rodzin z dziećmi! Pomocna obsługa, różnorodna oraz smaczna kuchnia czynią ten obiekt wartym polecenia. Dodatkowo jedna z najpiękniejszych plaż na Wyspach Kanaryjskich - Butihondo znajduje się bardzo blisko hotelu.', '', 'wakacje-w-alua-village', '', '', '', 'Wakacje w Alua Village', '', '', '', ''),
(337, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(337, 1, 2, 'Idealny obiekt dla szukających większej prywatności, a jednocześnie umożliwiający korzystanie ze wszystkich atrakcji typowych dla tradycyjnych hoteli. Polecamy wymagającym Klientom, z uwagi na jakość wykończenia suite i dobry serwis.', '', 'wakacje-w-amathus-elite-suites', '', '', '', 'Wakacje w Amathus Elite Suites', '', '', '', ''),
(338, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(338, 1, 2, 'Nowoczesny, elegancki i malowniczo położony na wzgórzu hotel z widokiem na Morze Jońskie i kontynentalną Grecję. Hotel należy do sieci Angsana, która może poszczycić się luksusowymi resortami głównie w Azji, a Angsana Corfu to jedyny – jak na razie – hotel tej marki w Europie.', '', 'wakacje-w-angsana-corfu-hotel', '', '', '', 'Wakacje w Angsana Corfu Hotel', '', '', '', ''),
(339, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(339, 1, 2, 'Odświeżony w 2016 roku, gustownie i nowocześnie urządzony, z tarasu słonecznego rozciąga się widok na Atlantyk i Funchal. Klienci wysoko oceniają czystość, obsługę i wyżywienie. Hotel z jedną z najbardziej dogodnych lokalizacji względem oceanu – około 250 metrów od nadoceanicznej promenady i kąpieliska Ponta Gorda. Jako bonus – hotel zapewnia darmowy transfer do centrum Funchal.', '', 'wakacje-w-baia-azul', '', '', '', 'Wakacje w Baia Azul', '', '', '', ''),
(340, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(340, 1, 2, 'Bardzo dobrej klasy hotel z nowoczesnymi pokojami i ładną strefą basenową. Rodziny docenią wygodne zakwaterowanie w eleganckich, przestronnych pokojach. Do tego urocza miejscowość i najpiękniejsze plaże wyspy Las Dunas.<p></p><p></p>', '', 'wakacje-w-barcelo-corralejo-bay', '', '', '', 'Wakacje w Barcelo Corralejo Bay', '', '', '', ''),
(341, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(341, 1, 2, 'Bardzo dobrej klasy hotel z nowoczesnymi pokojami i ładną strefą basenową. Rodziny docenią wygodne zakwaterowanie w eleganckich, przestronnych pokojach. Do tego urocza miejscowość i najpiękniejsze plaże wyspy Las Dunas.', '', 'wakacje-w-barcelo-corralejo-sands', '', '', '', 'Wakacje w Barcelo Corralejo Sands', '', '', '', ''),
(342, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(342, 1, 2, 'Ten ekskluzywny, nowocześnie zaprojektowany hotel z sieci Sandos, jest idealnym miejscem wypoczynku dla każdego. Oryginalna architektura, subtropikalny ogród i bliskość oceanu zapewnią każdemu przyjemne wakacje!', '', 'wakacje-w-barcelo-tenerife', '', '', '', 'Wakacje w Barcelo Tenerife', '', '', '', ''),
(343, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(343, 1, 2, 'Hotel na wakacje we dwoje lub w gronie znajomych. Przyjemna strefa basenowa oraz wygodne pokoje to wizytówki hotelu. Do tego położenie w jednym z najbardziej klimatycznych kurortów wyspy – lokalne życie miesza się z kosmopolityczną atmosferą typową dla miejsc popularnych turystycznie.', '', 'wakacje-w-be-live-adults-only-tenerife', '', '', '', 'Wakacje w Be Live Adults Only Tenerife', '', '', '', ''),
(344, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(344, 1, 2, 'Z pewnością komfortowe i ładne pokoje oraz fantastyczna lokalizacja przy klimatycznej, niewielkiej plaży z lokalnymi restauracjami i małym portem jachtowym, a w pobliżu dużo barów i sklepów. Świetne miejsce zarówno na rodzinny wypoczynek, jak i wakacje w gronie znajomych.', '', 'wakacje-w-be-live-experience-la-nina', '', '', '', 'Wakacje w Be Live Experience La Nina', '', '', '', ''),
(345, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(345, 1, 2, 'Hotel na wakacje z rodziną lub w gronie znajomych. Przyjemna strefa basenowa oraz wygodne pokoje to wizytówki hotelu. Do tego położenie w jednym z najbardziej klimatycznych kurortów wyspy – lokalne życie miesza się z kosmopolityczną atmosferą typową dla miejsc popularnych turystycznie.', '', 'wakacje-w-be-live-experience-orotava', '', '', '', 'Wakacje w Be Live Experience Orotava', '', '', '', ''),
(346, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(346, 1, 2, 'Hotel wyróżnia bardzo ładnie zaaranżowana strefa basenowa – 6 basenów (1 z nich podgrzewany całorocznie) położonych na 2 poziomach, w otoczeniu zieleni. Przestronne pokoje, bardzo dobrej jakości animacje i różnorodne oraz smaczne wyżywienie to również atuty hotelu. Hotel położony blisko barów i restauracji oraz ładnej plaży Fanabe.', '', 'wakacje-w-best-jacaranda', '', '', '', 'Wakacje w Best Jacaranda', '', '', '', ''),
(347, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(347, 1, 2, 'Luksusowy, elitarny hotel urządzony z dbałością o każdy szczegół. Krótko mówiąc hotel ma duszę i klimat i co ważne dla naszej planety - jest bardzo ekologiczny. Wiele detali wykonano ręcznie, np z drewna i innych naturalnych materiałów. Hotel spełni marzenie o bajecznych wakacjach każdego Klienta.', '', 'wakacje-w-boheme', '', '', '', 'Wakacje w Boheme', '', '', '', ''),
(348, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(348, 1, 2, 'Wygodne zakwaterowanie w bungalowach z osobną sypialnią i aneksem, do tego lokalizacja w kurorcie wakacyjnym Caleta de fuste. Dodatkowo lokalizacja blisko szerokiej piaszczystej plaży del Castillo. Polecamy!', '', 'wakacje-w-bungalows-castillo-playa', '', '', '', 'Wakacje w Bungalows Castillo Playa', '', '', '', ''),
(349, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(349, 1, 2, 'Goście doceniają odświeżone w 2018 roku wnętrza, wygodne pokoje (również z osobną sypialnią), przyjemny taras słoneczny w otoczeniu zieleni, smaczne wyżywienie oraz hotelowe animacje (również dla dzieci). Hotel zasługuję na uwagę ze względu na to, że to jeden z niewielu hoteli na całej Maderze położony przy piaszczystej plaży (za to „+”).', '', 'wakacje-w-calheta-beach', '', '', '', 'Wakacje w Calheta Beach', '', '', '', ''),
(350, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(350, 1, 2, 'Doskonała lokalizacja w samym centrum Folgaridy. Możliwość korzystania ze wschodnich i zachodnich stoków Val di Sole (Passo Groste ze snow parkiem i Pinzolo). W okolicy hotelu znajduje się dużo łatwych i średnich tras – polecamy rodzinom z dziećmi, jak i zapalonym narciarzom. Dodatkowym plusem hotelu jest bogata strefa wellness!', '', 'wakacje-w-caminetto', '', '', '', 'Wakacje w Caminetto', '', '', '', ''),
(351, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(351, 1, 2, 'Zadbany i świetnie położony obiekt. Wygodne i odnowione pokoje (za nie „+”), pomocna obsługa, różnorodna oraz smaczna kuchnia czynią ten obiekt wartym polecenia. Do tego nadmorska promenada i kameralny, uroczy kurort.', '', 'wakacje-w-castillo-san-jorge--antigua', '', '', '', 'Wakacje w Castillo San Jorge & Antigua', '', '', '', ''),
(352, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(352, 1, 2, 'Świetny hotel z bogatym, jak na 3*, zapleczem basenowym i rekreacyjnym. Polecamy osobom, które cenią klimat niewielkich miejscowości oraz wygodę programów All Inclusive. „+” za smaczne i różnorodne wyżywienie oraz przyjazną atmosferę.', '', 'wakacje-w-costa-caleta', '', '', '', 'Wakacje w Costa Caleta', '', '', '', ''),
(353, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(353, 1, 2, 'Wysokiej klasy hotel tylko dla dorosłych z nowocześnie urządzonymi pokojami polecamy Klientom, pragnącym wypocząć w luksusowych warunkach.', '', 'wakacje-w-dandrea-lagoon', '', '', '', 'Wakacje w D\'Andrea Lagoon', '', '', '', ''),
(354, 1, 1, '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(354, 1, 2, 'Na terenie kompleksu 2 baseny, kort tenisowy i zadbany ogród. Idealna baza wypadowa dla wszystkich tych, którzy na własną rękę chcieliby zwiedzać wyspę. Hotel dla niewymagających Klientów ale za to w bardzo dobrej cenie.', '', 'wakacje-w-dorisol-estrelicia', '', '', '', 'Wakacje w Dorisol Estrelicia', '', '', '', ''),
(355, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(355, 1, 2, 'To idealne miejsce, jeśli szukasz spokojnej, relaksującej przystani. Ciepłe słońce, morska atmosfera, piękna wioska Ouranoupolis tworzą cudowną kombinację, która tworzy niezapomniane wrażenia. Hotel słynie z obsługi na światowym poziomie i pięknych, luksusowych pokoi.', '', 'wakacje-w-eagles-resort', '', '', '', 'Wakacje w Eagles Resort', '', '', '', ''),
(356, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(356, 1, 2, 'Znana sieć hotelowa Bahia Principe wciela koncept Fantasia realizujący założenia hotelu przede wszystkim nastawionego na potrzeby Najmłodszych. Innowacyjne animacje, ekspedycje, gry, wieczorne przedstawienia, strefa basenowa, spa, menu restauracyjne – wszystko to ma na celu uatrakcyjnienie pobytu Dzieciom. Dla wszystkich luksusowe oraz nowoczesne pokoje oraz doskonałe wyżywienie.', '', 'wakacje-w-fantasia-bahia-principe-tenerife', '', '', '', 'Wakacje w Fantasia Bahia Principe Tenerife', '', '', '', ''),
(357, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(357, 1, 2, 'Hotel w pobliżu kurortu ale z dala od zgiełku Słonecznego Brzegu. Wyjątkowa oferta, wygodne all inclusive za przystępną cenę, plus za świeże wnętrza. Polecamy szczególnie rodzinom z dziećmi ze względu na komfort zakwaterowania w studiach lub apartamentach oraz nasz własny Figlo Club z polskimi animatorami - wakacje tu będą beztroskie i radosne!', '', 'wakacje-w-festa-gardenia-hills', '', '', '', 'Wakacje w Festa Gardenia Hills', '', '', '', ''),
(358, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(358, 1, 2, 'Hotel polecany tym, którzy za niewygórowaną cenę chcą przyjemnie spędzić wakacje na Fuerteventurze. Do tego wyremontowane pokoje i ładny basen (za to \"+\"). Costa Antigua to miejscowość idealna dla osób uciekających od hałasu typowego dla nadmorskich kurortów turystycznych. Świetna baza wypadowa do zwiedzania wyspy.', '', 'wakacje-w-globales-costa-tropical', '', '', '', 'Wakacje w Globales Costa Tropical', '', '', '', ''),
(359, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(359, 1, 2, 'Hit sprzedażowy sezonu 2018. Doskonale położony hotel, w samym sercu Makarskiej Riwiery, blisko bardzo urokliwej plaży i pełnej atrakcji promenady. Oferta przeznaczona dla Klientów, którzy chcieliby skorzystać nie tylko z plażowania i atrakcji kurortu, ale preferują aktywne zwiedzanie i odkrywanie tajemnic tego cudownego kraju. Serdecznie polecamy!', '', 'wakacje-w-gradac', '', '', '', 'Wakacje w Gradac', '', '', '', ''),
(360, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(360, 1, 2, '\"Wakacje w Grand Villa Argentina\"', '', 'wakacje-w-grand-villa-argentina', '', '', '', '\"Wakacje w Grand Villa Argentina\"', '', '', '', ''),
(361, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(361, 1, 2, 'Najnowszy z trzech 5* hoteli sieci H10 na Wyspach Kanaryjskich. Ekskluzywny i pięknie położony, z widokiem na ocean. Zlokalizowany blisko pól golfowych Costa Adeje, jest świetną propozycją dla amatorów tego sportu. Jednocześnie hotel oferuje bogate zaplecze rekreacyjne dla Najmłodszych i różnorodne animacje, które docenią Rodziny z Dziećmi. Dużym atutem hotelu jest też doskonały serwis oraz wysoki standard zakwaterowania. To propozycja idealna dla bardzo wymagających Klientów ceniących sobie luksus oraz obsługę na najwyższym poziomie.', '', 'wakacje-w-h10-atlantic-sunset', '', '', '', 'Wakacje w H10 Atlantic Sunset', '', '', '', ''),
(362, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(362, 1, 2, 'Lokalizacja hotelu oraz rozległy teren ogrodu sprawiają, że można tu wypocząć w ciszy i spokoju. Dużym atutem hotelu jest doskonały serwis oraz wysoki standard zakwaterowania, a dla najbardziej wymagających usługa Privilege. Na uwagę zasługuje też imponujące spa z bogatą ofertą zabiegów na ciało. To propozycja idealna dla wymagających Klientów ceniących sobie luksus oraz obsługę na najwyższym poziomie.', '', 'wakacje-w-h10-costa-adeje-palace', '', '', '', 'Wakacje w H10 Costa Adeje Palace', '', '', '', ''),
(363, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(363, 1, 2, 'Elegancki hotel z dużym ogrodem i ładną strefą basenową. Dodatkowym atutem jest dogodna lokalizacja blisko centrum kurortu i równocześnie przy oceanie. Do tego naprawdę ładne pokoje i usługa Privilege dla najbardziej wymagających Klientów. To znakomita propozycja dla każdego. Gorąco polecamy!', '', 'wakacje-w-h10-las-palmeras', '', '', '', 'Wakacje w H10 Las Palmeras', '', '', '', ''),
(364, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(364, 1, 2, 'Luksusowy hotel o niebywałym charakterze, lokalizacja hotelu sprawi, że poczujemy się tutaj jak w raju. Obiekt dla bardzo wymagających Gości, specjalnie dla tych, którzy szukają ciszy i spokoju hotel zapewnia odosobnioną plażę oraz miejsca w restauracji. Polecamy również rodzinom z dziećmi ze względu komfortowe pokoje rodzinne, mnogość atrakcji a także wyśmienitą kuchnię.', '', 'wakacje-w-hillside-beach', '', '', '', 'Wakacje w Hillside Beach', '', '', '', ''),
(365, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(365, 1, 2, 'Elegancki hotel z wygodnymi pokojami i ładną strefą basenową. Do tego bardzo dobra lokalizacja względem plaży i centrum kurortu – oba w zasięgu przyjemnego spaceru. Polecamy zarówno amatorom plażowania jak i nocnego życia.', '', 'wakacje-w-hovima-costa-adeje', '', '', '', 'Wakacje w Hovima Costa Adeje', '', '', '', ''),
(366, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(366, 1, 2, 'Rodzinny hotel z ładną strefą basenową i wygodnymi pokojami. Lokalizacja w malowniczej miejscowości Costa Adeje spełni oczekiwania spacerowiczów. To dobry wybór na rodzinny wypoczynek.', '', 'wakacje-w-hovima-jardin-caleta', '', '', '', 'Wakacje w Hovima Jardin Caleta', '', '', '', ''),
(367, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(367, 1, 2, 'Bardzo dobrej klasy hotel należący do znanej sieci IBEROSTAR. Świetna lokalizacja blisko turystycznego centrum, piaszczysta, szeroka plaża niedaleko hotelu, obsługa na wysokim poziomie, to tylko niektóre z atutów hotelu. Polecamy zarówno na rodzinne wakacje jak i urlop w gronie znajomych. „+” za wyremontowane pokoje i świetne wyżywienie.', '', 'wakacje-w-iberostar-bouganville-playa', '', '', '', 'Wakacje w IBEROSTAR Bouganville Playa', '', '', '', ''),
(368, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(368, 1, 2, 'Bardzo dobry kompleks dla wymagających Klientów, gwarantujący wysoki standard usług, sygnowany marką IBEROSTAR. Polecamy szczególnie osobom aktywnie spędzającym czas ze względu na różnorodność zaplecza rekreacyjnego dostępnego również w sąsiednim hotelu IBEROSTAR Gaviotas Playa.', '', 'wakacje-w-iberostar-playa-gaviotas-park', '', '', '', 'Wakacje w IBEROSTAR Playa Gaviotas Park', '', '', '', ''),
(369, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(369, 1, 2, 'Nowoczesny i odnowiony hotel znanej sieci Iberostar, gwarantującej najwyższą jakość usług. Doskonałe położenie tuż nad brzegiem morza i przy promenadzie zachęca do wieczornych spacerów.', '', 'wakacje-w-iberostar-playa-de-palma', '', '', '', 'Wakacje w IBEROSTAR Playa de Palma', '', '', '', ''),
(370, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(370, 1, 2, 'Elegancki, duży i rodzinny hotel w pierwszej linii od oceanu i jednocześnie tuż przy tętniącej życiem promenadzie. Te oraz inne atuty hotelu sprawią, że będzie to luksusowy wypoczynek dla całej rodziny.', '', 'wakacje-w-iberostar-selection-anthelia', '', '', '', 'Wakacje w IBEROSTAR Selection Anthelia', '', '', '', ''),
(371, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(371, 1, 2, 'Hotel dla bardzo wymagających Klientów, ceniących komfort wypoczynku, świetną kuchnię oraz wysoki standard usług. Dodatkowym jego atutem jest położenie przy fantastycznej i długiej na ponad 20 kilometrów, szerokiej plaży.', '', 'wakacje-w-iberostar-selection-fuerteventura-palace', '', '', '', 'Wakacje w IBEROSTAR Selection Fuerteventura Palace', '', '', '', ''),
(372, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(372, 1, 2, 'Hotel dla bardzo wymagających Klientów, ceniących komfort wypoczynku, świetną kuchnię oraz wysoki standard usług. Sporty wodne, bazy nurkowe oraz pole golfowe w okolicy hotelu - to wszystko sprawia, że urlop w IBEROSTAR Sabila na pewno będzie udany!', '', 'wakacje-w-iberostar-selection-sabila', '', '', '', 'Wakacje w IBEROSTAR Selection Sabila', '', '', '', ''),
(373, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(373, 1, 2, 'Hotel nie jest najnowszy, ale za to ma pierwszorzędną lokalizację przy jednej z flagowych plaż Fuerteventury - Playa Jandia. Okoliczne sklepy (duty free), restauracje i bary przyciagają wszystkich doceniających infrastrukturę turystyczną typową dla kurortów. Ładny ogród i strefa basenowa to dodatkowe atuty hotelu.', '', 'wakacje-w-ifa-altamarena', '', '', '', 'Wakacje w IFA Altamarena', '', '', '', ''),
(374, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(374, 1, 2, 'Jeden z najlepszych hoteli sieci Iberostar na wybrzeżu. Wyremontowany w 2018 roku (za to „+”), położony przy długiej, piaszczystej plaży, oferuje zakwaterowanie w przestronnych pokojach, ładną strefą basenową, smacznym wyżywieniem i bardzo dobrym serwisem. Do tętniącej życiem mariny, która przyciąga mnóstwem restauracji, sklepów i barów można dojść nadmorską promenadą.', '', 'wakacje-w-iberostar-marbella-coral-beach', '', '', '', 'Wakacje w Iberostar Marbella Coral Beach', '', '', '', ''),
(375, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(375, 1, 2, 'Wnętrza oraz design najwyższej jakości, ekskluzywne pokoje, bogate Ultra All Inclusive i menu hotelowe skomponowane przez szefów kuchni - laureatów gwiazdek Michelin a dla aktywnych mnogość sportów oraz różnorodne animacje dla dzieci– wszystko to składa się na wakacje w najnowszym i najbardziej luksusowym hotelu wybrzeża.', '', 'wakacje-w-ikos-andalucia', '', '', '', 'Wakacje w Ikos Andalucia', '', '', '', ''),
(376, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(376, 1, 2, 'Wnętrza oraz design, do stworzenia których użyto materiałów najwyższej jakości', '', 'wakacje-w-ikos-dassia', '', '', '', 'Wakacje w Ikos Dassia', '', '', '', ''),
(377, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(377, 1, 2, 'Wysokiej klasy obiekt, położony przy plaży. Idealny na wypoczynek dla dwojga.', '', 'wakacje-w-ikos-olivia', '', '', '', 'Wakacje w Ikos Olivia', '', '', '', ''),
(378, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(378, 1, 2, 'Hotel nie należy do najnowszych, ale za to jest bardzo dobrze utrzymany i w atrakcyjnej cenie. Duży i ładny ogród oraz basen, przestronne pokoje oraz bardzo dobra obsługa to wizytówki hotelu. Do tego All Inclusive (za dopłatą) dla wszystkich ceniących wygodę tej formuły. Polecamy!', '', 'wakacje-w-jardins-dajuda', '', '', '', 'Wakacje w Jardins d\'Ajuda', '', '', '', ''),
(379, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(379, 1, 2, 'Bardzo dobry hotel *** z wygodnym zakwaterowaniem i smacznym wyżywieniem, chwalony również za animacje. Świetna propozycja zarówno dla rodzin z dziećmi, jak i dla osób szukających nocnego życia. Jak na 3* hotel posiada ponadprzeciętną dla obiektów 3* infrastrukturę i właśnie za to \"+\".', '', 'wakacje-w-labranda-aloe-club-resort', '', '', '', 'Wakacje w LABRANDA Aloe Club Resort', '', '', '', ''),
(380, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(380, 1, 2, 'Bardzo ładnie zaaranżowana przestrzeń hotelowa, jednopiętrowe budynki położone wśród zadbanego ogrodu, 2 baseny o nieregularnych kształtach i duże apartamenty mogące pomieścić do 6 osób. Dużym atutem jest również położenie, w jednym z najchętniej odwiedzanych kurortów Teneryfy – Costa Adeje, w okolicy dużo restauracji, barów oraz sklepów.', '', 'wakacje-w-labranda-bahia-fanabe', '', '', '', 'Wakacje w LABRANDA Bahia Fanabe', '', '', '', ''),
(381, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(381, 1, 2, 'Hotel dla każdego. Wielbiciele życia nocnego docenią dużą ilość barów i restauracji, jaką oferuje Corralejo. Najmłodszym spodobają się baseny i zajęcia w miniklubie. Aktywnych zainteresuje szereg zajęć sportowych. A dla wszystkich świetne wyżywienie i dobry serwis sygnowany marką LABRANDA oraz naprawdę ładne i nowoczesne pokoje.', '', 'wakacje-w-labranda-bahia-de-lobos', '', '', '', 'Wakacje w LABRANDA Bahia de Lobos', '', '', '', ''),
(382, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(382, 1, 2, 'Nie najnowszy, ale dobrze utrzymany hotel, ze smacznym wyżywieniem - więcej niż dobre 3*. Dla wszystkich, którzy szukają wypoczynku w spokojnej miejscowości, z dala od hałasu typowego dla dużych kurortów. Jako bonus bardzo ładna plaża.', '', 'wakacje-w-labranda-golden-beach-hotel', '', '', '', 'Wakacje w LABRANDA Golden Beach Hotel', '', '', '', ''),
(383, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(383, 1, 2, 'Wysokiej klasy hotel polecamy głównie parom, szukającym ciszy i spokoju w pięknej scenerii hotelu. Dla wymagających Klientów nastawionych na dobrą kuchnię i nienaganny serwis.', '', 'wakacje-w-la-bisaccia', '', '', '', 'Wakacje w La Bisaccia', '', '', '', ''),
(384, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(384, 1, 2, 'Położony w pięknej okolicy, elegancki hotel oferujący wysokiej klasy serwis oraz wyśmienitą kuchnię. Idealne miejsce na relaks po aktywnym dniu spędzonym na stoku – hotel posiada dobrze wyposażone, duże centrum SPA. Dodatkowo, hotel jest niezwykle lubiany wśród Gości za miłą i pomocną obsługę!', '', 'wakacje-w-lagorai', '', '', '', 'Wakacje w Lagorai', '', '', '', ''),
(385, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(385, 1, 2, 'Malowniczo położony na wzgórzu hotel, idealny na rodzinny wypoczynek. Bogate zaplecze rekreacyjno-sportowe – za nie „+” (mini, maxi kluby dla dzieci i klub dla nastolatków, boisko multisportowe, park linowy, baseny, zjeżdżalnia, wodny plac zabaw) spełnią oczekiwania nie tylko Najmłodszych. Fantastyczna kuchnia, przestronne pokoje (również z osobną sypialnią) i sympatyczna obsługa dopełniają wizerunku hotelu bardzo dobrej klasy. Do tego widok na La Gomerę. Polecamy!', '', 'wakacje-w-landmar-costa-los-gigantes', '', '', '', 'Wakacje w Landmar Costa Los Gigantes', '', '', '', ''),
(386, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(386, 1, 2, 'Bardzo dobrej klasy, zadbany i stale rozwijający swoją infrastrukturę hotel, z fantastycznym wyżywieniem oraz serwisem. Plus za nowy basen i restaurację tapas oraz strefę tylko dla dorosłych. Hotel polecamy wszystkim tym, którzy uciekają od hałasu i blichtru kurortów typu Playa de Las Americas czy Los Cristianos. Do tego widok na Gomerę i górujący nad hotelem El Teide!', '', 'wakacje-w-landmar-playa-la-arena-exbe-live-experience-playa-la-arena', '', '', '', 'Wakacje w Landmar Playa La Arena (ex.Be Live Experience Playa La Arena)', '', '', '', ''),
(387, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(387, 1, 2, 'Zachwycający hotel tylko dla dorosłych polecamy Klientom, którzy pragną spędzić luksusowe wakacje w ekskluzywnie zaprojektowanym hotelu.', '', 'wakacje-w-lango-design-hotel-and-spa', '', '', '', 'Wakacje w Lango Design Hotel and SPA', '', '', '', ''),
(388, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(388, 1, 2, 'Nowa inwestycja prężnie rozwijającej się sieci hotelowej LABRANDA na Fuerteventurze. Na uwagę zasługuje położenie w najbardziej atrakcyjnym w naszej opinii kurorcie i w odległości przyjemnego spaceru od jednej z najładniejszych plaż wyspy, dodatkowo na Gości czekają nowoczesne pokoje i wnętrza.', '', 'wakacje-w-lemon--soul-cactus-garden', '', '', '', 'Wakacje w Lemon & Soul Cactus Garden', '', '', '', ''),
(389, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(389, 1, 2, 'Wyjątkowy, minimalistyczny hotel zbudowany z myślą o naprawdę luksusowym wypoczynku. Obiekt schodzi kaskadowo do morza i praktycznie każda przestrzeń posiada cudowny widok na Morze Jońskie. Gorąco polecamy!', '', 'wakacje-w-lesante-blu-exclusive-beach-resort', '', '', '', 'Wakacje w Lesante Blu Exclusive Beach Resort', '', '', '', ''),
(390, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(390, 1, 2, 'Luksusowy hotel położony kaskadowo, o bardzo wysokim standardzie usług, idealny na wypoczynek z rodziną jak również na romantyczny wyjazd we dwoje. Oferuje szeroki wachlarz atrakcji, pyszną kuchnię, nowoczesne i komfortowe pokoje oraz znakomicie przystosowane plaże. Hotel dla bardzo wymagających Gości, którzy szukają niezapomnianych wrażeń.', '', 'wakacje-w-lujo-hotel', '', '', '', 'Wakacje w Lujo Hotel', '', '', '', ''),
(391, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(391, 1, 2, 'Wygodne i eleganckie pokoje różnego typu (również rodzinne i z prywatnym basenem), doskonałe restauracje i bary, pięknie zaaranżowane wnętrza oraz świetnie utrzymany ogród, dobrze zagospodarowana plaża z łagodnym zejściem do morza oraz obsługa na najwyższym poziomie – wszystko to składa się na jeden z najlepszych hoteli na wyspie. Polecamy!', '', 'wakacje-w-marbella-corfu', '', '', '', 'Wakacje w MarBella Corfu', '', '', '', ''),
(392, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(392, 1, 2, 'Jeden z najlepszych hoteli na wyspie, a na pewno najpiękniej położony (za to „+”) - ocean wraz z plażą tworzą niezapomnianą lagunę. Dla rodzin z dziećmi, dla amatorów wind-', '', 'wakacje-w-melia-fuerteventura', '', '', '', 'Wakacje w Melia Fuerteventura', '', '', '', ''),
(393, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(393, 1, 2, 'Luksus, wygoda, relaks - to trzy słowa, które przychodza na myśl każdemu kto w nim zamieszka. Zapierający dech w piersiach widok na Morze Egejskie, obsługa, która zadba o wszystko. W takim klimacie poczujesz spokój i odprężenie. Gorąco polecamy!', '', 'wakacje-w-myconian-korali', '', '', '', 'Wakacje w Myconian Korali', '', '', '', ''),
(394, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(394, 1, 2, 'Jeden z najlepszych hoteli na wyspie. Nowoczesny design, profesjonalna obsługa, przepyszna kawa - to wszystko składa się na luksusowy odpoczynek w Myconian Kyma. Idealne miejsce na romantyczne wakacje we dwoje.', '', 'wakacje-w-myconian-kyma', '', '', '', 'Wakacje w Myconian Kyma', '', '', '', ''),
(395, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(395, 1, 2, 'Kameralnie położone apartamenty w sąsiedztwie majestatycznej Montana de Gauza, zlokalizowane niedaleko centrum, plaży i lotniska. Do tego nowoczesne i funkcjonalne zakwaterowanie i ładna strefa basenowa. Polecamy na wypoczynek zarówno dla Rodzin, par jak i grup znajomych.', '', 'wakacje-w-ohasis-apartments', '', '', '', 'Wakacje w Ohasis Apartments', '', '', '', ''),
(396, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(396, 1, 2, 'Jeden z najlepszych hoteli na wyspie, zaprojektowany z myślą o prawdziwym relaksie wśród dorosłych Klientów. Wnętrza z litego drewna, surowego betonu i designerskie dodatki tworzą klimat tego obiektu. Gorąco polecamy!', '', 'wakacje-w-olea-all-suite-hotel', '', '', '', 'Wakacje w Olea All Suite Hotel', '', '', '', ''),
(397, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(397, 1, 2, 'Zupełna nowość w ofercie! Idealna propozycja dla rodzin czy grup znajomych lubiących spędzać wakacje w swoim gronie - duży, zadbany ogród, prywatny basen, w pełni wypasożone wnętrza. Polecamy wszystkim tym, którzy cenią sobie luksus oraz prywatność na wakacjach.', '', 'wakacje-w-olympus-villas', '', '', '', 'Wakacje w Olympus Villas', '', '', '', ''),
(398, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(398, 1, 2, 'Podstawowe 3* położone w mieście - w pobliżu hotelu bary i restauracje. Hotel dla wszystkich osób, które za niewygórowaną cenę chcą spędzić wakacje na Maderze i korzystać z typowo miejskich atrakcji.', '', 'wakacje-w-orquidea', '', '', '', 'Wakacje w Orquidea', '', '', '', ''),
(399, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(399, 1, 2, 'Bardzo elegancki i luksusowy hotel dla wyjątkowo wymagających osób. Szeroki wybór typów pokoi pozwoli dopasować ofertę do potrzeb każdego Klienta. Bogata infrastruktura sportowa i animacyjna gwarantuje doskonały wypoczynek szczególnie dla par jak i rodzin z dziećmi. Hotel został wyremontowany w 2015 r. W tym hotelu zadowolenie Klienta jest zawsze na pierwszym miejscu.', '', 'wakacje-w-papillon-zeugma', '', '', '', 'Wakacje w Papillon Zeugma', '', '', '', ''),
(400, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(400, 1, 2, 'Obiekt bardzo skromny z podstawowym wyposażeniem. Polecamy osobom, dla których standard zakwaterowania ma drugorzędne znaczenie, ale za to liczy się cena. Odpowiedni jako baza wypadowa do zwiedzania najpiękniejszych zakątków Teneryfy. W najbliższej okolicy obiektu czeka na Gości przyrodnicza atrakcja - wulkaniczna góra Montana Amarilla, która zachwyca malowniczymi, wyżłobionymi tarasami. Amatorom snorkelingu i nurkowania polecamy eksplorowanie podwodnej części tego wzgórza.<p></p>', '', 'wakacje-w-parque-carolina-apartments', '', '', '', 'Wakacje w Parque Carolina Apartments', '', '', '', ''),
(401, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(401, 1, 2, 'Bardzo dobry hotel, wyremontowany w 2015/2016 roku i pięknie położony - formacje skalne na plaży wraz z błękitem oceanu pozostawiają niezapomniane wrażenia. Do tego sam Alvor - spokojny, malowniczy z dobrymi restauracjami rybnymi i fajnymi pubami, jeszcze nie zepsuty blichtrem typowym dla kurortów.', '', 'wakacje-w-pestana-alvor-praia', '', '', '', 'Wakacje w Pestana Alvor Praia', '', '', '', ''),
(402, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(402, 1, 2, 'Luksusowy, pięknie wykończone naturalnymi materiałami wnętrza, wygodne pokoje mogące pomieścić do 4 osób, 6 basenów, 3 restauracje serwujące dania bazujące na naturalnych składnikach, rozbudowany miniklub z restauracją dla dzieci i placem zabaw, infrastruktura dla aktywnych – to najważniejsza słowa-klucze opisujące hotel. Piękne plaże oraz urocze Alvor w zasięgu przyjemnego spaceru.', '', 'wakacje-w-pestana-blue-alvor', '', '', '', 'Wakacje w Pestana Blue Alvor', '', '', '', ''),
(403, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(403, 1, 2, 'Nienajnowszy, ale bardzo dobrze utrzymany hotel w świetnej lokalizacji. Bliskość oceanu i centrum urokliwej stolicy wysypy oraz pomocna obsługa i smaczne posiłki, do tego basen i przepiękne widoki. Polecamy!', '', 'wakacje-w-quinta-bela-sao-tiago', '', '', '', 'Wakacje w Quinta Bela Sao Tiago', '', '', '', ''),
(404, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(404, 1, 2, 'Rewelacyjny hotel położony na terenie jednej z najbardziej ekskluzywnych marin na Bałkanach. Świetne, luksusowe pokoje, obsługa na najwyższym, światowym poziomie. Doskonałe miejsce wypadowe na wycieczki, np. do perełki Bałkanów - Kotoru tylko 6 km.', '', 'wakacje-w-regent-porto-montenegro', '', '', '', 'Wakacje w Regent Porto Montenegro', '', '', '', ''),
(405, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(405, 1, 2, 'Bardzo elegancki hotel, którego główną zaletą jest rozbudowana strefa basenowa gwarantująca rozrywkę zarówno dla dzieci jak i dorosłych. Bogata oferta All Inclusive oraz bardzo dobry serwis sprawiają, że to idealny hotel na wakacyjny wypoczynek. Krótki transfer z lotniska jest dodatkową zaletą.', '', 'wakacje-w-royal-holiday-palace', '', '', '', 'Wakacje w Royal Holiday Palace', '', '', '', ''),
(406, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(406, 1, 2, 'Hotel znajduje się w spokojnej okolicy i jest położony przy jednej z najładniejszych plaż Fuerteventury, ciągnącej się na ponad 20 km - Playa de Jandia. Dedykowany jest osobom dorosłym (18+) więc idealny na wypoczynek we dwoje. Hotel zapewnia dzienne animacje oraz wieczorami muzykę na żywo lub z DJ. Bardzo ładne pokoje, różnorodne wyżywienie i przede wszystkim imponujące tarasy słoneczne z basenami i z widokiem na ocean to wizytówki hotelu. Dla poszukujących większej ilości rozrywek pobliska Jandia oferuje szeroki wybór barów i restauracji.', '', 'wakacje-w-royal-palm-resort--spa', '', '', '', 'Wakacje w Royal Palm Resort & Spa', '', '', '', ''),
(407, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(407, 1, 2, 'Bardzo elegancki hotel, którego główną zaletą jest rozbudowana strefa basenowa gwarantująca rozrywkę zarówno dla dzieci jak i dorosłych. Bogata oferta All Inclusive oraz bardzo dobry serwis sprawiają, że to idealny hotel na wakacyjny wypoczynek. Krótki transfer z lotniska jest dodatkową zaletą.', '', 'wakacje-w-royal-wings', '', '', '', 'Wakacje w Royal Wings', '', '', '', ''),
(408, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(408, 1, 2, 'Nowoczesny, stylowy hotel urządzony według najwyższych standardów i zaprojektowany przez jedną z najbardziej znanych portugalskich architektek – Nini Andrade Silva. Przestronne pokoje (również z oddzielną sypialnią), tarasy słoneczne z basenami i widokiem na ocean, posiłki przygotowane z najlepszych składników, położenie przy niewielkiej hotelowej plaży i nieopodal jednej z dwóch piaszczystych plaż wyspy. Dodatkowo, <b>tylko i wyłącznie dla Klientów Rainbow</b>, możliwość korzystania z basenów, przekąsek i napojów w hotelu Calheta Beach (usługa płatna dodatkowo).', '', 'wakacje-w-saccharum', '', '', '', 'Wakacje w Saccharum', '', '', '', ''),
(409, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(409, 1, 2, 'Kameralny hotel o bardzo rodzinnej atmosferze, oferujący wysoki standard i jakość świadczonych usług. Położony w pobliżu wyciągu Marilleva 900, skąd można dostać się do kompleksów ponad 120 km tras narciarskich, co zadowoli najbardziej zapalonych narciarzy. Dodatkowo, ze względu na dobrze wyposażone centrum SPA, polecamy miłośnikom relaksu po całym dniu spędzonym na stoku. Idealny na wypoczynek w gronie rodziny oraz przyjaciół!', '', 'wakacje-w-salvadori', '', '', '', 'Wakacje w Salvadori', '', '', '', ''),
(410, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(410, 1, 2, 'Komfortowy hotel o eleganckich wnętrzach. Pięknie położony przy jednej z najładniejszych plaż na półwyspie. Marka Sani zapewnia wysoki standard usług i doskonałe zaplecze hotelowe. Polecamy wymagającym Klientom.', '', 'wakacje-w-sani-beach', '', '', '', 'Wakacje w Sani Beach', '', '', '', ''),
(411, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(411, 1, 2, 'Wysokiej klasy, nowocześnie urządzony hotel usytuowany w spokojnej okolicy – w otoczeniu morza, plaży i sosnowych lasów. Doskonała propozycja dla wszystkich, którzy szukają miejsca na romantyczne wakacje w atmosferze relaksu i luksusu.', '', 'wakacje-w-santa-marta-hotel--spa', '', '', '', 'Wakacje w Santa Marta Hotel & SPA', '', '', '', ''),
(412, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(412, 1, 2, 'Lokalizacja kompleksu w pięknie zagospodarowanym ogrodzie, profesjonalna obsługa na najwyższym poziomie i hotelowe usługi sprawiają, że jest to dobra propozycja dla bardzo wymagających Klientów. Ponadto bliskie położenie względem atrakcji turystycznych regionu zachęca do okrywania Kampanii również na własną rękę.', '', 'wakacje-w-savoy-beach', '', '', '', 'Wakacje w Savoy Beach', '', '', '', ''),
(413, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(413, 1, 2, 'Najlepszy i najnowszy hotel 5* na Maderze, z luksusowymi pokojami (dostępne również z niewielkim basenem). Na uwagę zasługuje także piękny ogród z dużym basenem oraz elegancko zaaranżowane Laurea Spa. Hotel położony w odległości przyjemnego spaceru od centrum miasta, w bezpośredniej okolicy kilka barów i restauracji.', '', 'wakacje-w-savoy-palace', '', '', '', 'Wakacje w Savoy Palace', '', '', '', ''),
(414, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(414, 1, 2, 'Jedyne 5* na wyspie posiadające kategorię Gran Luxe. Hotel wyróżniony wieloma międzynarodowymi nagrodami za usługi, gastronomię i spa. Do tego cudne widoki na sąsiednie wyspy Lobos i Lanzarote.', '', 'wakacje-w-secrets-bahia-real-ex-gran-atlantis-bahia-real', '', '', '', 'Wakacje w Secrets Bahia Real (ex. Gran Atlantis Bahia Real)', '', '', '', ''),
(415, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(415, 1, 2, 'Ekskluzywny hotel polecamy wymagającym Klientom pragnącym spędzić wakacje w otoczeniu malowniczych widoków na góry i Morze Egejskie. Wysoki standard świadczonych usług oraz wyśmienite jedzenie umożliwią relaks i niezapomniany wypoczynek.', '', 'wakacje-w-sheraton-hotel-rodos', '', '', '', 'Wakacje w Sheraton Hotel Rodos', '', '', '', ''),
(416, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(416, 1, 2, 'Niezwykle klimatyczny hotel, który pomimo swoich rozmiarów zapewnia kameralną atmosferę. Największym atutem jest piękne położenie na wzgórzu co gwarantuje wspaniałe widoki na turkusowe morze oraz piękną plażę. Hotel chwalony jest za profesjonalną, sympatyczną obsługę oraz doskonałą kuchnię. Świetna oferta na wakacje we dwoje oraz w gronie znajomych.', '', 'wakacje-w-smeraldo-beach', '', '', '', 'Wakacje w Smeraldo Beach', '', '', '', ''),
(417, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(417, 1, 2, 'Dobry hotel z wygodnymi pokojami, do tego dwie ładne strefy basenowe. Hotel chwalony za dobry serwis i sympatyczną, pomocną obsługę. Idealne miejsce na spokojny wypoczynek z Rodziną lub w grupie znajomych oraz do eksplorowania szczególnie północnej części wyspy.', '', 'wakacje-w-smy-puerto-de-la-cruz', '', '', '', 'Wakacje w Smy Puerto de la Cruz', '', '', '', ''),
(418, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(418, 1, 2, 'Komfortowy hotel z idealną lokalizacją tuż przy plaży i w centrum tętniącego życiem Playa de Los Cristianos. Idealny na wypoczynek we dwoje i w gronie znajomych.<p></p>', '', 'wakacje-w-spring-arona-gran-hotel--spa', '', '', '', 'Wakacje w Spring Arona Gran Hotel & Spa', '', '', '', ''),
(419, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(419, 1, 2, 'Komfortowy hotel z idealną lokalizacją niedaleko nadmorskiej promenady łączącej kurorty, w centrum tętniącego życiem Playa de las Americas. Mnogość aktywności nie tylko dla Najmłodszych, duże baseny i ładne odnowione pokoje. Hotel dedykowany Wszystkim, zarówno grupom znajmomych jak i Rodzinm z Dziećmi.', '', 'wakacje-w-spring-hotel-bitacora', '', '', '', 'Wakacje w Spring Hotel Bitacora', '', '', '', ''),
(420, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(420, 1, 2, 'Komfortowy hotel z idealną lokalizacją tuż przy plaży i w centrum tętniącego życiem Playa de Las Americas. Idealny na wypoczynek we dwoje i w gronie znajmoych.', '', 'wakacje-w-spring-hotel-vulcano', '', '', '', 'Wakacje w Spring Hotel Vulcano', '', '', '', ''),
(421, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(421, 1, 2, 'Fantastyczny kompleks wakacyjny, malowniczo położony na klifie, otoczony tropikalnym ogrodem, z imponującymi basenami. Hotel polecamy wymagającym Klientom, którzy poszukują wioski wakacyjnej wysokiej klasy ze świetnym wyżywieniem i serwisem. Piąte słoneczko za All inclusive w karaibskim stylu.', '', 'wakacje-w-sunlight-bahia-principe-tenerife-resort', '', '', '', 'Wakacje w Sunlight Bahia Principe Tenerife Resort', '', '', '', ''),
(422, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(422, 1, 2, '\"Wakacje w Tao Morro Jable\"', '', 'wakacje-w-tao-morro-jable', '', '', '', '\"Wakacje w Tao Morro Jable\"', '', '', '', ''),
(423, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(423, 1, 2, 'Bardzo przyjemny, wyremontowany hotel z przestronnymi pokojami. Do tego ładna strefa basenowa i bliskość plaży, uczynią urlop w nim spędzony bardzo udanym.', '', 'wakacje-w-tropical-park', '', '', '', 'Wakacje w Tropical Park', '', '', '', ''),
(424, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(424, 1, 2, 'Vienoula\'s Garden to hotel w którym każdy pozna prawdziwą grecką gościnność. Prowadzony przez rodzinę obiekt bardzo dba o wygodę Gości, roztacza nad nimi opiekę i zapewnia przyjazną atmosferę. Komfortowe pokoje zaprojektowane w cykladzkim stylu sprawią, że Twój pobyt będzie niezapomniany.', '', 'wakacje-w-vienoulas-garden', '', '', '', 'Wakacje w Vienoula\'s Garden', '', '', '', ''),
(425, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(425, 1, 2, 'Budżetowy 3* hotel w dobrej lokalizacji.', '', 'wakacje-w-villa-de-adeje-beach', '', '', '', 'Wakacje w Villa de Adeje Beach', '', '', '', ''),
(426, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(426, 1, 2, 'Reyjkjavik - stolica Islandii • na styku płyt tektonicznych - gorące gejzery i wulkany • malownicze wodospady • fiordy i zapierające dech w piersiach klify • Blue Lagoon - nietypowe SPA', '', 'wycieczka-dookoa-islandii', '', '', '', 'Wycieczka Dookoła Islandii', '', '', '', ''),
(427, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(427, 1, 2, 'Ateny – miasto Zeusa • Mykonos – egejskie wiatraki • Chania - piękna architektura i plażowanie • Santorini – biało-błękitna wyspa • statek Horizon **** all inclusive - polski pilot na pokładzie statku', '', 'wycieczka-rejs-po-morzu-egejskim---biao---bkitne-cyklady', '', '', '', 'Wycieczka Rejs po morzu Egejskim - Biało - błękitne Cyklady', '', '', '', ''),
(428, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(428, 1, 2, 'Bergen - stara Norwegia • Alesund – Droga Trolli • Stavanger - urzekająca starówka i granitowe klify • Geiranger - Droga Orłów • Amsterdam - miasto kwiatów • Flam - słynna linia kolejowa Flåmsbana • statek Costa Favolosa **** full board - polski pilot na pokładzie statku', '', 'wycieczka-rejs-po-norweskich-fiordach---w-majestatycznych-grach', '', '', '', 'Wycieczka Rejs po norweskich fiordach - W majestatycznych górach', '', '', '', '');
